INSERT INTO `yy_information_content` (`id`, `information_id`, `lang`, `title`, `content`) VALUES
(1, 1, 'en', 'FAQ', '<p><a href=\"#faq1\">Are they here really paying for reviews? </a></p>\r\n\r\n<p><a href=\"#faq2\">How much will I get for viewing the review I wrote? \r\n\r\n<p><a href=\"#faq3\">How often statistics are updated in my account? \r\n\r\n<p><a href=\"#faq4\">What are review bonuses? What determines the size of the bonus? \r\n\r\n<p><a href=\"#faq5\">What is social moderation? How to become a public moderator? How much is paid to public moderators? \r\n\r\n<p><a href=\"#faq6\">Do you have a referral program? \r\n\r\n<p><a href=\"#faq7\">Can I post my promotional code in my own comments/comments on Tajrobtak.com? \r\n\r\n<p><a href=\"#faq8\">How to earn more? \r\n\r\n<p><a href=\"#faq9\">Where can I post links to my reviews? </a></p>\r\n\r\n<p><a href=\"#faq10\">How can I get my money? </a></p>\r\n\r\n<p><a href=\"#faq11\">I looked at my reviews from another computer, but the next day the number of views from my reviews increased no more than usual. Why? </a></p>\r\n\r\n<p><a href=\"#faq12\">Why do I have a review rating of +1 (or any other), and the number of views is 0? After all, you cannot put a rating without reviewing a review? </a></p>\r\n\r\n<p><a href=\"#faq13\">How are the reviews sorted on the product page? </a></p>\r\n\r\n<p><a href=\"#faq14\">What happens if I copy text from another site? And if I rewrite someone else\'s text in my own words? </a></p>\r\n\r\n<p><a href=\"#faq15\">Can I add my text, previously published on another site? </a></p>\r\n\r\n<p><a href=\"#faq16\">How to edit my review? </a></p>\r\n\r\n<p><a href=\"#faq17\">How to add a new product/service to the catalog? </a></p>\r\n\r\n<p><a href=\"#faq18\">How to contact the user who left a review? </a></p>\r\n\r\n<p><a href=\"#faq19\">Why can\'t I comment on reviews? </a></p>\r\n\r\n<p><a href=\"#faq20\">Why is my review not published for a long time? </a></p>\r\n\r\n<p><a href=\"#faq21\">How to become the official representative of the brand/company on Tajrobtak.com? </a></p>\r\n\r\n<p><a href=\"#faq22\">Why confirm the status of the official representative of the brand/company and what it gives? </a></p>\r\n\r\n<p><a href=\"#faq23\">My account was blocked unfairly. What to do? </a></p>\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n<div id=\"faq1\">\r\n<h2>Are they here really paying for reviews? </h2>\r\n<p>\r\nYes, review authors receive money for publishing reviews and for viewing reviews written by them. See below for details, as well as in the Affiliate Program Rules. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq2\">\r\n<h2>How much will I get for viewing the review I wrote? </h2>\r\n<p>\r\nThe basic principle is this: every time someone reviews your review, you get 0.074 cents per account. Statistics are updated once a day, you can watch it on the \"billing\" page. It is impossible to predict how much a particular review will earn in advance - the earnings of different reviews may differ a thousand times or more. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq3\">\r\n<h2>How often statistics are updated in my account?  </h2>\r\n<p>Statistics are updated once a day, you can view it on the “billing” page </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq4\">\r\n<h2>What are feedback bonuses? What determines the size of the bonus?  </h2>\r\n<p>Bonuses are a one-time payment that is credited within a week after the publication of a new review. </p>\r\n\r\n<p>The size of the bonus depends on the product/service category, the number of other reviews per topic, the quality and relevance of the review. The biggest bonuses are awarded for reviews in the following categories: “Auto”, “Technique”, “Beauty and Health”, “Tourism”. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq5\">\r\n<h2>What is social moderation? How to become a public moderator? How much is paid to public moderators?  </h2>\r\n<p>\r\n\r\nTajrobtak.com has pre-moderated reviews. It is carried out by public moderators. This feature is available to experienced authors who have been on the site for at least 1 year and have written at least 50 reviews. \r\n\r\nIf you want to participate in public moderation, and your account meets the requirements specified above, you can submit an application to the site\'s support service. \r\n\r\nPublic moderators receive 0.29 cents for each verified review. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq6\">\r\n<h2>Do you have a referral program?  </h2>\r\n<p>\r\n\r\nYes. You can invite friends to the site, inviting them to register using your promotional code. Each author on Tajrobtak.com, who published at least three reviews, has a personal promotional code (see the tab \"Refer a Friend\" in the Personal Account). According to the Rules of the site, the user is accrued daily with additional funds in the amount of 20% of the rewards for views of the authors who registered using the individual promotional code of this user. In turn, a user who registered using your promotional code, after registration, receives 50 cents to the balance in his account. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq7\">\r\n<h2>Can I post my promotional code in my own comments/comments on Tajrobtak.com?  </h2>\r\n<p>Not. On Tajrobtak.com it is prohibited to post any referral links and codes, including the codes of Tajrobtak.com itself. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq8\">\r\n<h2>How can I get my money?  </h2>\r\n<p>The following withdrawal options are available: number of PayPal or Visa card. You can order a withdrawal on the \"Billing\" page when there are more than 10 dollars on your account. Money is transferred within 10 days after ordering. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq9\">\r\n<h2>I looked at my reviews from another computer, but the next day the number of views from my reviews increased no more than usual. Why?  </h2>\r\n<p>We reserve the right not to count and not pay for those views that we consider invalid (cheating viewing counters). You should not try to increase views by viewing your reviews from another computer, or ask your friends to \"view all my reviews.\" Such scans for counters are statistically easily computable and will not be counted. In general, a small percentage of the total number of views is not counted, and it does not have a significant impact on the earnings of users who are not trying to deceive the counters. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq10\">\r\n<h2>Why do I have a review rating of +1 (or any other), and the number of views is 0? After all, you cannot put a rating without reviewing a review?  </h2>\r\n<p>View statistics are counted once a day, and voting is counted immediately. Thus, if a user came to your review today and voted for him, the vote will be counted immediately, and the viewing will be taken into account in the statistics only tomorrow. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq11\">\r\n<h2>How are the reviews sorted on the product page?  </h2>\r\n<p>We have developed an algorithm that analyzes the behavior of third-party readers of reviews and calculates the most interesting and useful reviews, which are in the first lines of the list. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq12\">\r\n<h2>What happens if I copy text from another site? And if I rewrite someone else\'s text in my own words?  </h2>\r\n<p>We are very strict with plagiarism. Each review is automatically checked for uniqueness. If the text is found on the Internet partially or completely, the author’s account is immediately blocked. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq13\">\r\n<h2>How to earn more?  </h2>\r\n<ul>\r\n<li>The topic of a review should be relevant and interesting to many, otherwise, where can you get views? </li>\r\n\r\n<li>The feedback should contain information useful to potential readers. </li>\r\n\r\n<li>Structured reviews containing informative and high-quality photos bring more views. </li>\r\n\r\n<li>Attract friends to the site. The more authors register using your promotional code, the more you earn. </li>\r\n</ul>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq14\">\r\n<h2>Where can I post links to my reviews?  </h2>\r\n<p>You can publish links to your reviews on your pages on social networks and in any discussions on the topic of a review. Distributing links through spam is strictly prohibited. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq15\">\r\n<h2>Can I add my text, previously published on another site?  </h2>\r\n<p>No, texts previously posted on other sites are not published. Please do not copy your reviews from other sites to Tajrobtak.com We block the author’s account if we find that a review has previously even been partially posted on the Internet. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq16\">\r\n<h2>How to edit your review?  </h2>\r\n<p>Open the menu on the feedback page (the button with the three dots on the right) and click \"Edit\" </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq17\">\r\n<h2>How to add a new product/service to the catalog?  </h2>\r\n<p>Once you click to add a review, you can easily add a new product/service/ company if it was not all ready founded in categories. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq18\">\r\n<h2>How to contact the user who left a review?  </h2>\r\n<p>We do not transfer user data to third parties (See Privacy Policy). You can register, confirm email and write a private message to the user or leave a comment to the review. </p>\r\n</div>\r\n\r\n \r\n\r\n\r\n<div id=\"faq19\">\r\n<h2>Why can\'t I comment on reviews?  </h2>\r\n<p>To access some features of the site, you must confirm the email. The confirmation link is sent to your email at registration. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq20\">\r\n<h2>Why is my review not published for a long time?  </h2>\r\n<p>The site has a pre-moderation, which can take from several minutes to 24 hours. Please have patience. If the review does not contain violations of the Site Rules, it will be published without fail. </p>\r\n</div>\r\n\r\n \r\n\r\n \r\n\r\n\r\n<div id=\"faq21\">\r\n<h2>How to become the official representative of the brand/company on Tajrobtak.com?  </h2>\r\n<ul>\r\n\r\n<li> Create an account using the name of your organization as your login, confirm your email. If you already have an account under the organization name, skip this step. </li>\r\n<li> Submit a request for assigning the status of a company representative to the site\'s support service (info@tajrobtak.com). Attach to the request an official letter on the letterhead of your organization, from which it follows that the login you have registered does indeed belong to the representative of the company. The letter must be stamped and contain the main details of the organization (full name, TIN, legal address, etc.). Sample letter </li>\r\n<li> After verification, you will receive the status of the official representative of the brand/company. An icon will appear next to your avatar. </li>\r\n</ul>\r\n</div>\r\n\r\n \r\n\r\n\r\n<div id=\"faq22\">\r\n<h2>Why confirm the status of the official representative of the brand/company and what it gives?  </h2>\r\n<p>The status of the official representative gives you the opportunity to submit requests for changes in information about the organization, post official responses to reviews and communicate with users. For more details on the interaction between users and company representatives, see clause 10.1. Site rules. </p>\r\n<p>The authority of the official representative is limited to the Site Rules. In case of their violation, the account may be blocked. </p>\r\n</div>\r\n\r\n \r\n\r\n\r\n<div id=\"faq23\">\r\n<h2>My account was blocked unfairly. What to do?  </h2>\r\n<p>The main reasons why an account can be blocked are plagiarism, spamming, obscene expressions, insults, violations of the rights, morality, and ethics, ignoring the rules of the site. If you think that you have been unfairly blocked, please write to info@tajrobtak.com </p>\r\n</div>'),
(2, 1, 'ar', 'الأسئلة الأكثر طرحاً', '<p dir=\"RTL\"><a href=\"#\">هل هم هنا يدفعون حقا عند كتابة &quot; تجربتك &quot;؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">كم سأحصل على نشر &quot;تجربتك&quot; التي كتبتها؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">كم مرة يتم تحديث الإحصائيات في حسابي؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">ما هي مكافآت كتابتي لـ &quot; تجربتك &quot; ؟ ما الذي يحدد حجم المكافأة؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">ما هو مجتمع المشرفيين؟ كيف تصبح مشرف عام؟ كم يدفع للمشرفين العامين؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">هل لديك برنامج الشراكة؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">هل يمكنني نشر الكود الترويجي في منشوراتي &quot; تجربتك &quot; / تعليقاتي على <span dir=\"LTR\">Tajrobtak.com</span>؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">كيف تكسب المزيد من المشاهدات على &quot; تجربتك &quot;؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">أين يمكنني نشر روابط لمراجعاتي؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">كيف يمكنني الحصول على أموالي؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">نظرت إلى تعليقاتي من جهاز كمبيوتر آخر ، ولكن في اليوم التالي لم يرتفع عدد المشاهدات على &quot; تجربتك &quot; أكثر من المعتاد. لماذا ا؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">لماذا لدي تقييم لمراجعة +1 (أو أي تقييم آخر) ، وعدد المشاهدات هو 0؟ بعد كل شيء ، لا يمكنك وضع تقييم دون مشاهدة &quot; تجربتك &quot;؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">كيف يتم فرز &quot; تجربتك &quot; على صفحة المنتج؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">ماذا يحدث إذا قمت بنسخ نص من موقع آخر؟ وإذا أعدت كتابة نص شخص آخر بكلماتي الخاصة؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">هل يمكنني إضافة النص الخاص بي ، والذي تم نشره مسبقًا على موقع آخر؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">كيفية تحرير &quot; تجربتك &quot; ؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">كيف تضيف منتج / خدمة جديدة إلى الكتالوج؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">كيفية الاتصال بالمستخدم الذي كتب &quot; تجربتك &quot;؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">لماذا لا يمكنني التعليق على &quot; تجربتك &quot;؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">لماذا لم يتم نشر &quot; تجربتك &quot; الخاص بي لفترة طويلة؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">كيف تصبح الممثل الرسمي للعلامة التجارية / الشركة على <span dir=\"LTR\">Tajrobtak.com</span>؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">لماذا تؤكد حالة الممثل الرسمي للعلامة / الشركة وماذا تعطي؟</a></p>\r\n\r\n<p dir=\"RTL\"><a href=\"#\">تم حظر حسابي بشكل غير عادل. ماذا أفعل؟</a></p>\r\n\r\n<h2 dir=\"RTL\">هل هم هنا يدفعون حقا لكتابة &quot; تجربتك&quot; ؟</h2>\r\n\r\n<p dir=\"RTL\">نعم ، يحصل المؤلفون المال لنشر &quot; تجربتك &quot; ولعرض التجارب التي يكتبونها. انظر أدناه للحصول على التفاصيل ، وكذلك في قواعد برنامج الشراكة.</p>\r\n\r\n<h2 dir=\"RTL\">كم سأحصل على مشاهدة &quot;تجربتك&quot; التي كتبتها؟</h2>\r\n\r\n<p dir=\"RTL\">المبدأ الأساسي هو: في كل مرة يراجع فيها شخص ما &quot; تجربتك&quot; ، تحصل على 0.074 سنتًا لكل حساب. يتم تحديث الإحصاءات مرة واحدة يوميًا ، ويمكنك مشاهدتها في صفحة &quot;الفواتير&quot;. من المستحيل التنبؤ بالمقدار الذي ستحصل عليه &quot;تجربتك&quot; معينة مقدمًا - قد تختلف أرباح &quot;تجربتك&quot; المختلفة ألف مرة أو أكثر.</p>\r\n\r\n<h2 dir=\"RTL\">كم مرة يتم تحديث الإحصائيات في حسابي؟</h2>\r\n\r\n<p dir=\"RTL\">يتم تحديث الإحصائيات مرة واحدة في اليوم ، يمكنك مشاهدتها على صفحة &quot;الفواتير&quot; في حسابك الشخصي.</p>\r\n\r\n<h2 dir=\"RTL\">ما هي مكافآت كتابتي لـ &quot; تجربتك &quot; ؟ ما الذي يحدد حجم المكافأة؟</h2>\r\n\r\n<p dir=\"RTL\">المكافآت هي عبارة عن دفعة لمرة واحدة يتم اعتمادها في غضون أسبوع بعد نشر &quot; تجربتك &quot; جديدة.</p>\r\n\r\n<p dir=\"RTL\">يعتمد حجم المكافأة على فئة المنتج / الخدمة ، وعدد المراجعات الأخرى لكل موضوع ، ونوعية &quot; تجربتك &quot; وملاءمتها. يتم منح المكافآت الكبرى لـ &quot; تجربتك &quot; في الفئات التالية: &quot;السيارات&quot; ، &quot;التقنية&quot; ، &quot;الجمال والصحة&quot; ، &quot;السياحة&quot;.</p>\r\n\r\n<h2 dir=\"RTL\">ما هو مجتمع المشرفيين؟ كيف تصبح مشرف عام؟ كم يدفع للمشرفين العامين؟</h2>\r\n\r\n<p dir=\"RTL\">يحتوي <span dir=\"LTR\">Tajrobtak.com</span> على تجارب تم تدقيقها مسبقاً من قبل المشرفيين العامين. هذه الميزة متاحة للمؤلفين ذوي الخبرة الذين كانوا في الموقع لمدة سنة على الأقل وقد كتبوا 50 &quot;تجربتك&quot; على الأقل.</p>\r\n\r\n<p dir=\"RTL\">إذا كنت ترغب في المشاركة في الإشراف العام ، وكان حسابك يستوفي المتطلبات المحددة أعلاه ، فيمكنك إرسال طلب إلى خدمة دعم الموقع.</p>\r\n\r\n<p dir=\"RTL\">يتلقى المشرفون العامون 0.29 سنتًا لكل &quot; تجربتك &quot; تم التحقق منها.</p>\r\n\r\n<h2 dir=\"RTL\">هل لديك برنامج إحالة الأصدقاء؟</h2>\r\n\r\n<p dir=\"RTL\">نعم فعلا. يمكنك دعوة الأصدقاء إلى الموقع ، ودعوتهم للتسجيل باستخدام شفرتك الترويجية. يحتوي كل مؤلف على موقع <span dir=\"LTR\">Tajrobtak.com</span> ، الذي نشر ما لا يقل عن ثلاث مراجعات ، على شفرة ترويجية شخصية (راجع علامة التبويب &quot;إحالة صديق&quot; في الحساب الشخصي). وفقًا لقواعد الموقع ، يتراكم المستخدم يوميًا بأموال إضافية بقيمة 20٪ من المكافآت مقابل المشاهدات للمؤلفين الذين سجلوا باستخدام الشفرة الترويجية الفردية لهذا المستخدم. في المقابل ، يتلقى المستخدم الذي سجّل باستخدام شفرتك الترويجية ، بعد التسجيل ، 50 سنتًا إلى الرصيد في حسابه.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">هل يمكنني نشر شفرتي الترويجية في التعليقات / التعليقات الخاصة بي على <span dir=\"LTR\">Tajrobtak.com</span>؟</h2>\r\n\r\n<p dir=\"RTL\">ليس في <span dir=\"LTR\">Tajrobtak.com</span> يُحظر نشر أية روابط ورموز إحالة ، بما في ذلك رموز موقع <span dir=\"LTR\">Tajrobtak.com</span> نفسه.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">كيف يمكنني الحصول على أموالي؟</h2>\r\n\r\n<p dir=\"RTL\">خيارات السحب التالية متاحة: رقم بطاقة <span dir=\"LTR\">PayPal</span> أو <span dir=\"LTR\">Visa</span>. يمكنك طلب سحب على صفحة &quot;الفواتير&quot; عندما يكون هناك أكثر من 10 دولارات في حسابك. يتم تحويل الأموال في غضون 10 أيام بعد الطلب.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">نظرت إلى &quot;تجربتك&quot; تقييمي من جهاز كمبيوتر آخر ، ولكن في اليوم التالي لم يرتفع عدد المشاهدات من مراجعاتي أكثر من المعتاد. لماذا ا؟</h2>\r\n\r\n<p dir=\"RTL\">نحن نحتفظ بالحق في عدم الاعتماد وعدم الدفع مقابل تلك المشاهدات التي نعتبرها غير صالحة (عدادات مشاهدة وهمية). يجب عدم محاولة زيادة المشاهدات من خلال عرض تجاربك من جهاز كمبيوتر آخر ، أو مطالبة أصدقائك بـ &quot;عرض جميع تجاربي&quot;. مثل عمليات الفحص للعدادات سهلة الحساب من الناحية الإحصائية ولن يتم حسابها. بشكل عام ، لا يتم حساب نسبة مئوية صغيرة من إجمالي عدد المشاهدات ، وليس له تأثير كبير على أرباح المستخدمين الذين لا يحاولون خداع العدادات.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">لماذا لدي تقييم لمراجعة +1 (أو أي تقييم آخر) ، وعدد المشاهدات هو 0؟ بعد كل شيء ، لا يمكنك وضع تقييم دون مراجعة مراجعة؟</h2>\r\n\r\n<p dir=\"RTL\">يتم حساب إحصاءات المشاهدة مرة واحدة في اليوم ، ويتم احتساب التصويت على الفور. وبالتالي ، إذا جاء المستخدم لمراجعتك اليوم وصوت لصالحه ، فسيتم احتساب التصويت على الفور ، وسيتم أخذ المشاهدة في الاعتبار فقط في الإحصاءات غدًا.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">كيف يتم فرز المراجعات على صفحة المنتج؟</h2>\r\n\r\n<p dir=\"RTL\">لقد طورنا خوارزمية تحلل سلوك قارئي التعليقات التابعين لأطراف ثالثة وتحسب المراجعات الأكثر إثارة وإثارة للاهتمام ، والتي هي في الأسطر الأولى من القائمة.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">ماذا يحدث إذا قمت بنسخ نص من موقع آخر؟ وإذا أعدت كتابة نص شخص آخر بكلماتي الخاصة؟</h2>\r\n\r\n<p dir=\"RTL\">نحن صارمون جدا مع الانتحال. يتم فحص كل مراجعة تلقائيًا للتميز. إذا تم العثور على النص على الإنترنت جزئيًا أو كليًا ، فسيتم حظر حساب المؤلف فورًا.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">كيف تكسب المزيد؟</h2>\r\n\r\n<p dir=\"RTL\">1) يجب أن يكون موضوع المراجعة ملائماً ومثيراً للاهتمام بالنسبة للكثيرين ، وإلا ، أين يمكنك الحصول على وجهات النظر؟</p>\r\n\r\n<p dir=\"RTL\">2) يجب أن تحتوي الملاحظات على معلومات مفيدة للقراء المحتملين.</p>\r\n\r\n<p dir=\"RTL\">3) المراجعات المنظمة التي تحتوي على صور غنية بالمعلومات وذات جودة عالية تجلب المزيد من المشاهدات.</p>\r\n\r\n<p dir=\"RTL\">4) جذب الاصدقاء الى الموقع. كلما زاد عدد المؤلفين الذين يستخدمون الشفرة الترويجية ، زادت أرباحك.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">أين يمكنني نشر روابط لمراجعاتي؟</h2>\r\n\r\n<p dir=\"RTL\">يمكنك نشر روابط لمراجعتك على صفحاتك على الشبكات الاجتماعية وفي أي مناقشات حول موضوع المراجعة. يحظر تمامًا توزيع الروابط عبر الرسائل غير المرغوب فيها.</p>\r\n\r\n<p dir=\"RTL\">هل يمكنني إضافة النص الخاص بي ، والذي تم نشره مسبقًا على موقع آخر؟</p>\r\n\r\n<p dir=\"RTL\">لا ، لا يتم نشر النصوص المنشورة مسبقًا على مواقع أخرى. الرجاء عدم نسخ تعليقاتك من مواقع أخرى إلى <span dir=\"LTR\">Tajrobtak.com</span> نحن نحظر حساب المؤلف إذا وجدنا أن تعليقًا سبق نشره جزئيًا على الإنترنت.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">كيف تحرر مراجعتك؟</h2>\r\n\r\n<p dir=\"RTL\">افتح القائمة على صفحة التعليقات (الزر مع النقاط الثلاث على اليمين) وانقر على &quot;تحرير&quot;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">كيف تضيف منتج / خدمة جديدة إلى الكتالوج؟</h2>\r\n\r\n<p dir=\"RTL\">بمجرد النقر لإضافة مراجعة ، يمكنك بسهولة إضافة منتج / خدمة / شركة جديدة إذا لم تكن جاهزة بالكامل في فئات.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">كيفية الاتصال بالمستخدم الذي ترك التعليق؟</h2>\r\n\r\n<p dir=\"RTL\">نحن لا ننقل بيانات المستخدم إلى أطراف ثالثة (راجع سياسة الخصوصية). يمكنك التسجيل وتأكيد البريد الإلكتروني وكتابة رسالة خاصة للمستخدم أو ترك تعليق للمراجعة.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">لماذا لا يمكنني التعليق على التعليقات؟</h2>\r\n\r\n<p dir=\"RTL\">للوصول إلى بعض ميزات الموقع ، يجب عليك تأكيد البريد الإلكتروني. يتم إرسال رابط التأكيد إلى بريدك الإلكتروني عند التسجيل.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">لماذا لم يتم نشر تقييمي لفترة طويلة؟</h2>\r\n\r\n<p dir=\"RTL\">يحتوي الموقع على اعتدال مسبق ، يمكن أن يستغرق من عدة دقائق إلى 24 ساعة. يرجى التحلي بالصبر. إذا لم تتضمن المراجعة انتهاكات لقواعد الموقع ، فسيتم نشرها بدون فشل.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">كيف تصبح الممثل الرسمي للعلامة التجارية / الشركة على <span dir=\"LTR\">Tajrobtak.com</span>؟</h2>\r\n\r\n<p dir=\"RTL\">1. أنشئ حسابًا باستخدام اسم مؤسستك كمعلومات تسجيل الدخول الخاصة بك ، وقم بتأكيد بريدك الإلكتروني. إذا كان لديك بالفعل حساب باسم المؤسسة ، تخطى هذه الخطوة.</p>\r\n\r\n<p dir=\"RTL\">2. تقديم طلب لتعيين حالة ممثل الشركة إلى خدمة دعم الموقع (<span dir=\"LTR\">info@tajrobtak.com</span>). أرفق الطلب برسالة رسمية على ترويسة مؤسستك ، والتي يتبعها أن تسجيل الدخول الذي قمت بتسجيله ينتمي بالفعل إلى ممثل الشركة. يجب ختم الخطاب ويحتوي على التفاصيل الرئيسية للمنظمة (الاسم الكامل ، <span dir=\"LTR\">TIN</span> ، العنوان القانوني ، وما إلى ذلك). خطاب عينة</p>\r\n\r\n<p dir=\"RTL\">3. بعد التحقق ، سوف تتلقى حالة الممثل الرسمي للعلامة التجارية / الشركة. سيظهر رمز بجانب الصورة الرمزية الخاصة بك.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">لماذا تؤكد حالة الممثل الرسمي للعلامة / الشركة وماذا تعطي؟</h2>\r\n\r\n<p dir=\"RTL\">تمنحك حالة الممثل الرسمي فرصة تقديم طلبات لإجراء تغييرات في المعلومات حول المنظمة ، ونشر ردود رسمية على المراجعات والتواصل مع المستخدمين. لمزيد من التفاصيل حول التفاعل بين المستخدمين وممثلي الشركة ، راجع الفقرة 10.1. قواعد الموقع.</p>\r\n\r\n<p dir=\"RTL\">تقتصر سلطة الممثل الرسمي على قواعد الموقع. في حالة انتهاكها ، قد يتم حظر الحساب.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">تم حظر حسابي بشكل غير عادل. ماذا أفعل؟</h2>\r\n\r\n<p dir=\"RTL\">تتمثل الأسباب الرئيسية وراء حظر الحساب في الانتحال ، والرسائل غير المرغوب فيها ، والتعبيرات الفاحشة ، والإهانات ، وانتهاك الحقوق ، والأخلاق ، والأخلاق ، وتجاهل قواعد الموقع. إذا كنت تعتقد أنك قد تم حجبها بشكل غير عادل ، يرجى الكتابة إلى <span dir=\"LTR\">info@tajrobtak.com</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n'),
(3, 2, 'ar', 'الدعم', ''),
(4, 2, 'en', 'Support', '');
INSERT INTO `yy_information_content` (`id`, `information_id`, `lang`, `title`, `content`) VALUES
(5, 3, 'ar', 'شروط الإستخدام', '<p style=\"text-align:right\"><span dir=\"RTL\">&nbsp;من جهة , و مستخدم الإنترنت , الذي وافق على العرض الموجود على الإنترنت تحت الرابط </span><a href=\"http://tajrobtak.com\">Tajrobtak.com</a> <span dir=\"RTL\">إن مسؤول موقع<br />\r\n&nbsp;, قد قاموا بالإتفاقية على النحو التالي:</span> &nbsp;&nbsp;<a href=\"http://tajrobtak.com/ar/information/rules\">http://tajrobtak.com/ar/information/rules</a> <span dir=\"RTL\">الالكتروني</span></p>\r\n\r\n<h2 style=\"text-align: right;\"><span style=\"font-size:12px\"><span dir=\"RTL\">1. الشروط و التعريفات:</span></span></h2>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.1. في إتفاقية المستخدم هذه , ما لم ينص صريحاً على ذلك , فإن التعريفات التالية ستحمل المعاني على النحو التالي:</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">.</span><a href=\"http://tajrobtak.com\">Tajrobtak.com</a> <span dir=\"RTL\">&quot;المسؤول&quot; : &quot; الأدمن &quot; هو الجهة القانونية المسؤولة عن النطاق تحت مسمى</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&quot; التعليقات &quot; : عمل قام بإنشاءه المستخدم بالتفاعل مع التقييمات &quot; تجربتك &quot; التي قام بإنشاءها مستخدمي الموقع و الذي يخضع لحقوق الطبع و النشر.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&quot; الحساب الشخصي &quot; : مجموعة من الصفحات الأمنة في الموقع التي انشأت نتيجةً لتسجيل المستخدم في الموقع , حيث يتمكن المستخدم من تغيير و استكمال البيانات الخاصة به , استقبال و تحرير البيانات الشخصية باستخدام الميزات الوظيفية للموقع.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&quot; تجربتك &quot; : او يمكن الإشارة له بـ &quot; التجربة &quot; أو &quot; المراجعة &quot; أو &quot; التقييم &quot; , هو عمل ( يتكون من صور و / أو نصوص ) قام بإنشاءه مستخدميين الموقع الذين يعبرون به عن رأيهم الشخصي بمنتج أو خدمة او سلعة أو وجهة سفر أو كتاب قرأه إلى اخره و الذي يخضع لحقوق الطبع و النشر.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&quot; المستخدم &quot; : هو شخص قام بإتفاقية مع المسؤول عن طريق قبول العرض الموجود على الإنترنت على الرابط الإلتكروني</span><br />\r\n<a href=\"http://tajrobtak.com/ar/information/rules\">http://tajrobtak.com/ar/information/rules</a><br />\r\n<span dir=\"RTL\">مستخدم الموقع لا يمكن أن يكون تحت سن ال 16 ( ستة عشر ) عاماً.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&quot;الموقع &quot; : هو مجموعة من المعلومات , النصوص , العناصر المرسومة , التصميم , الصور , الصور الفوتوغرافية , و فيديوهات و عناصر ملكية فكرية أخرى , &nbsp;فضلا عن برامج الكمبيوتر التي تضم معلومات منظمة و ذلك للحرص على إتاحة هذا النوع من المعلومات على الإنترنت على الوقع الإلكتروني </span><br />\r\n<a href=\"http://Tajrobtak.com\">Tajrobtak.com</a><br />\r\n.<a href=\"http://Tajrobtak.com\">Tajrobtak.com</a>&nbsp; <span dir=\"RTL\">او على مواقع إلكترونية اخرى لكن ضمن نطاق موقع</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&nbsp;او على مواقع إلكترونية أخرى لكن ضمن نطاق موقع </span><a href=\"http://Tajrobtak.com\">Tajrobtak.com</a> <span dir=\"RTL\">مساحة الموقع متاحة على الموقع الإلكتروني<br />\r\n&nbsp;الذي يعد عمل معقد تم إنشاءه و الذي يقوم بتنظيمه المسؤول &quot; الأدمن &quot;.</span><a href=\"http://Tajrobtak.com\">Tajrobtak.com</a></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&quot; الإتفاقية &quot; : إتفاقية المستخدم هذه و التي تحتوي على فقرات و مقالات للتعريف أكثر بالإتفاقية.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&quot; الجهات &quot; : و يمكن الإشارة لهم ب &quot; الأطراف &quot; الذين هم المستخدم و المسؤول.</span></p>\r\n\r\n<p style=\"text-align:right\">&nbsp;&nbsp; <span dir=\"RTL\">2.1. جميع الشروط و التعريفات الموجودة في نص هذه الإتفاقية فسرت من قبل الأطراف وفقاً للقواعد المعتادة لقواعد تفسير مصطلحات اتفاقيات المستخدم ذات الصلة المعترف بها على الإنترنت. </span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">3.1. عنواين المقالات لهذه الإتفاقية تهدف فقط لتسهيل الفهم لنص هذه الإتفاقية و لا تحمل أي معنى قانوني حرفياً.</span></p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<h1 style=\"text-align:right\"><span style=\"font-size:20px\"><strong><span dir=\"RTL\">2. الإجراءات المتخذة لعقد الإتفاقية</span></strong></span></h1>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.2 نص هذه الإتفاقية منشور بشكل دائم على الموقع على الرابط الإلكتروني</span><br />\r\n<a href=\"http://tajrobtak.com/ar/information/rules\">http://tajrobtak.com/ar/information/rules</a><br />\r\n<span dir=\"RTL\">و الذي يحتوي على جميع الشروط الأساسية و هو عرض عام يمكن لجميع مستخدمي الأنترنت الوصول إليه و الإطلاع عليه.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">2.2. يعتبر القبول المناسب للعرض هو بالتنفيذ المنسق للإجراءات التالية بواسطة المستخدم :<br />\r\n1.2.2. التعرف بشروط الإتفاقية.<br />\r\n2.2.2. ادخال معلومات دقيقة و حديثة كبيانات للاعتماد (&nbsp; تسجيل دخول المستخدم , البريد الإلكتروني , كلمة السر مع التأكيد المتكرر) و الرمز الرقمي ( كابتشا ) في استمارة التسجيل , الموجودة على رابط &quot; التسجيل &quot; على الموقع .<br />\r\n&nbsp;3.2.2. وضع الرمز في حقل خاص تحت العنوان &quot;أوافق على&quot; اتفاقية المستخدم &quot;و&quot; قواعد برنامج الشريك &quot;في نموذج التسجيل المكتمل.</span><br />\r\n&nbsp;<span dir=\"RTL\">4.2.2. الضغط على زر &quot;التسجيل&quot; في استمارة التسجيل المكتملة.</span></p>\r\n\r\n<p style=\"text-align:right\">&nbsp;<span dir=\"RTL\">3.2. منذ اللحظة التي يتم فيها اتخاذ الإجراءات المحددة في الفقرة 2.2 من الاتفاقية ، يعتبر العرض مقبولًا ، ويتم إبرام الاتفاقية وفقًا للشروط المحددة أدناه.</span></p>\r\n\r\n<p dir=\"RTL\">بالنقر على &quot;&rlm;للتسجيل&rlm;&quot;، فإنك توافق على &rlm;الشروط&rlm; و&rlm;سياسة البيانات&rlm; و&rlm;سياسة ملفات تعريف الارتباط&rlm;.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\"><span style=\"font-size:20px\"><strong>3. موضوع الإتفاقية</strong></span><br />\r\n1.3. يعطي المسؤول المستخدم فرصة الوصول إلى الموقع ، والحق في إنشاء &quot;تجربتك&quot;و نشرها (يمكن الإشارةلـتجربتك بـ &quot; التقييمات&quot; &quot; المراجعات &quot; او &quot; التجربة &quot; أو &quot; التجارب&quot; ) ، وتلقي أحدث المعلومات حول التعليقات الجديدة على تقييمات المستخدميين المحددة من قبل ، ونشر التعليقات ، وينقل المستخدم الحقوق الحصرية إلى المسؤول لإنشاء / تحرير &quot; تجربتك ( لتتناسب مع القسم الذي يجب ان توجد فيه , ذلك لا يعني تغيير فعلي لا جزئياً ولا كاملاً لما كتبه المستخدم )&quot; التقييمات &quot; و التعليقات الخاصة بالمستخدم.</span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:20px\"><span dir=\"RTL\"><strong>4.إجراءات استخدام الموقع</strong></span></span><br />\r\n&nbsp;<span dir=\"RTL\">1.4. قبل التسجيل ، يقدم المسؤول لأي شخص ، بما في ذلك الشخص الذي سيقوم في وقت لاحق بتنفيذ الإجراءات المحددة في الاتفاقية ليصبح مستخدماً ، القدرة على الوصول إلى الموقع ، والمعلومات على الموقع ، بما في ذلك التجارب &quot; التقييمات &quot; والتعليقات ،و لكن دون القدرة على ترك التعليقات و استخدام وظائف أخرى في الموقع أوالحساب الشخصي المتاح فقط للمستخدمين.<br />\r\n2.4. بعد التسجيل ، يتم منح المستخدم حق الوصول إلى الحساب الشخصي باستخدام بيانات الاعتماد - تسجيل الدخول وكلمة المرور.</span><br />\r\n&nbsp;<span dir=\"RTL\">3.4. إستخدام الوظائف المتاحة في الحساب الشخصي ، يحصل المستخدم فرصة على :<br />\r\n1.3.4 تغيير بيانات الاعتماد (عنوان البريد الإلكتروني وكلمة المرور) ، أضافة صورة ، خاضعــة&nbsp; لأحـــكام الفقرة 8.3.6 من الاتفاقية&nbsp; وغير ذلك ، تغيير وإدارة بيانات المستخدم في الحساب الشخصي المنصوص عليها من خلال واجهة المستخدم الخاصة بالحساب الشخصي.</span><br />\r\n&nbsp;<span dir=\"RTL\">2.3.4. تبادل الرسائل الشخصية مع مستخدمين آخرين للموقع.<br />\r\n3.3.4. الاشتراك في التقييمات &quot; التجارب &quot; &nbsp;وتلقي المعلومات ، والإشعارات ، إن أمكن ، إلى عنوان البريد الإلكتروني للمستخدم الذي تم تحديده أثناء التسجيل على الموقع ( عنوان البريد الإلكتروني ) ، حول التعليقات الجديدة التي أضافها مستخدمي الموقع حول التقييمات &quot; التجارب &quot; التي قام المستخدم بالفعل بالاشتراك بها على الحساب الشخصي .<br />\r\n4.3.4.كتابة &quot; تجربتك &quot; و نشرها القدرة على ترك التعليقات على تجارب الأخرين .<br />\r\n4.4.تقع على عاتق المستخدم ضمان سلامة وأمن كلمة المرور و عدم مشاركتها لأطراف ثالثة. في حالة فقدان أو اختراق كلمة المرور ، وكذلك في حالة التملك غير المشروع &nbsp;من قبل أطراف ثالثة للوصول إلى الحساب الشخصي ، يلتزم المستخدم بإعلام المسؤول عن حالة إختراق للحساب الشخصي و ذلك عن &nbsp;طريق البريد الإلكتروني</span><br />\r\ninfo@tajrobtak.com<br />\r\n<span dir=\"RTL\">وإلى أن يتم تلقي مثل هذه الرسالة حول البلاغ ، فسيتم اعتبار جميع الإجراءات أو التعليقات التي يتم تنفيذها من الحساب الشخصي للمستخدم على أنها تمت بواسطة المستخدم نفسه.</span></p>\r\n\r\n<p style=\"text-align:right\">&nbsp;<span dir=\"RTL\">5.4. يلتزم المستخدم باستخدام الموقع و الحساب الشخصي بنية حسنة ، دون انتهاك حقوق وحريات الأطراف الثالثة ، ومعايير الأخلاق والقيم ، دون استخدام الأجهزة أو الوسائل التقنية التي يمكن أن تحدث تغييرات في عمل الموقع &nbsp;والحساب الشخصي &nbsp;التي لا يتم توفيرها أثناء الاستخدام العادي. على وجه الخصوص ، يتعهد المستخدم بعدم نشر معلومات على &nbsp;الموقع التي تنتهك حقوق ومصالح الأطراف الثالثة. المستخدم هو المسؤول الوحيد عن أي أعمال غير قانونية يرتكبها المستخدم باستخدام الموقع.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\"><span style=\"font-size:20px\">5<strong>. &quot; تجربتك &quot; عن ماذا يجب أن تكون و ما هي متطلباتها ؟</strong></span><br />\r\n1.5. يجب تخصيص &quot; تجربتك &quot; (التقييمات ) لمنتج معين على ان يكون المنتج \\ موجود في وقت إعداد التقييم في السوق ومتاح بشكل شامل للمستهلكين. يتعهد المستخدم للإشارة إلى الاسم الكامل للمنتج ، والذي يتضمن إشارة إلى نوع المنتج والعلامة التجارية واسم المنتج. يشار إلى نوع السلعة أو الخدمة أو المنتج باللغة العربية أو الإنجليزية فقط.<br />\r\n2.5. لا يجوز نشر &quot; تجربتك &quot; (التقييمات &quot; التجارب&quot; ) المتعلقة بـ :<br />\r\n1.2.5. المنتجات الفريدة أو النادرة، بما في ذلك المنتجات محلية الصنع &quot; يدوية الصنع &quot; &nbsp;والمنتجات التي تحضر بطلب مسبق من المنتج أي التي تصنع خصيصاً بناءاً على طلب مسبق.</span><br />\r\n&nbsp;<span dir=\"RTL\">2.2.5. المنتجات النادرة ، بما في ذلك المنتجات العتيقة ( الأثرية ) .<br />\r\n3.2.5. المنتجات التي تنتهك القانون ، بما في ذلك المنتجات المزيفة.<br />\r\n4.2.5. المنتجات الجنسية .<br />\r\n5.2.5. المنتجات المرتبطة بالمقامرة.<br />\r\n6.2.5. المنتجات المتشابهة لموقع تجربتك أو التي تحمل ضمنياً أهداف مشابهة لموقع تجربتك.<br />\r\n7.2.5. المنتجات / المواقع التي تنتهك قانون حقوق الطبع والنشر و الملكية الفكرية.<br />\r\n8.2.5. المنتجات التي تهدف إلى خداع المستخدمين ، والمنتجات الإعلانية وغيرها (المواقع التي تحتوي على استبيانات مدفوعة ، ونقرات ، وإعجابات ، وعمليات إعادة نشر ، وتصفح ، وما إلى ذلك).<br />\r\n9.2.5. الإجراءات أو أساليب الإجراءات التي ترتبط بالمنتج بشكل غير مباشر ، بما في ذلك وصفات الطعام.<br />\r\n10.2.5. الأفراد المحددين مع أسمائهم وغيرها من البيانات الشخصية الخاصة بهم ، بغض النظر عن علاقتهم بالمنتجات.<br />\r\n11.2.5. صفحات يوتيوب الشخصية والقنوات التي يوجد بها اقل من 200000 مشترك.<br />\r\n12.2.5. السياسة والسياسيين.<br />\r\n13.2.5. العطور التي ليست في العبوة الأصلية.<br />\r\n14.2.5 مستحضرات &nbsp;العناية و التجميل ، الحميات الغذائية ، ومستحضرات التجميل و / أو العمليات الجراحية التجميلية ، إذا لم يكن بعد التجريب الوقت الكافي للخروج بالنتائج الكافية لكتابة &quot; تجربتك &quot; .</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">3.5. تجربتك (التقييمات أو &nbsp;التجارب ) يجب ان تكون :</span><br />\r\n&nbsp;<span dir=\"RTL\">1.3.5. ابداعية ، مما يعني ، أن المستخدم ملزم بإعداد &quot;تجربتك&quot; بعمله الإبداعي الشخصي دون مشاركة أطراف ثالثة في إنشاء &quot;تجربتك &quot; ( التقييم أو التجربة ).</span><br />\r\n&nbsp;<span dir=\"RTL\">2.3.5. ذاتية ، مما يعني ، يجب على المستخدم إنشاء &quot; تجربتك &quot; ( التقييم أو التجربة ) تستند فقط على تجربته الشخصية لاستخدام المنتج.</span><br />\r\n&nbsp;<span dir=\"RTL\">3.3.5. موثوق بها ، مما يعني ،أن &nbsp;لا تحتوي على معلومات خاطئة عن عمد عن المنتج.<br />\r\n4.3.5. &nbsp;قيَمة ، مما يعني أن &quot; تجربتك &quot; ( التقييم أوالتجربة ) يجب أن تحتوي على رأي المستخدم بشأن خصائص المنتج ، ويجب ألا تحتوي على معلومات تشوه كرامة وسمعة الأطراف الثالثة (بما في ذلك الأطراف القانونية) او الأطراف المنتجة للمنتج، لا ينبغي أن تنتهك الحقوق &nbsp;,الأخلاق ,و القيم للأطراف الثالثة.</span><br />\r\n&nbsp;<span dir=\"RTL\">5.3.5. فريدة ، مما يعني أن المستخدم ليس لديه الحق في نشر &quot; تجربتك &quot; ( التقييم أوالتجربة ) على الموقع &nbsp;إذا كانت مكررة أو تعتمد على عمل آخر تم نشره من قبل مستخدم آخر.<br />\r\n6.3.5. مليئة بالمعلومات, &nbsp;مما يعني أنه يجب على تقيييم المستخدم أن يبين خصائص المستهلك الرئيسي للمنتج ، ولكن دون التأثير على إستهلاكا لمنتج من قبل مستخدمين الآخرين ، مثلاً عدم الكشف عن محتوى الأفلام أوالكتب.<br />\r\n4.5. يجب أن يكون العمل الفوتوغرافي كجزء من &quot; تجربتك &quot; ( التقييم أوالتجربة ) &nbsp;بصيغة<br />\r\n)</span> jpg <span dir=\"RTL\">و</span> jpeg <span dir=\"RTL\">و</span> png<span dir=\"RTL\">(<br />\r\nو ان يبلغ الحد الأقصى لحجم التنزيل 20 ميغابايت. يجب أن تكون الصور في &quot; تجربتك &quot;( التقييم أوالتجربة ) &nbsp;&nbsp;فريدة وعالية الجودة وواضحة وتتعلق بموضوع &quot; تجربتك &quot; ( التقييم أوالتجربة ). يحظر استخدام الصور من الإنترنت. تشويه نتائج استخدام المنتج في برامج تحرير الرسومات غير مقبول. في &quot; تجربتك &quot;( التقييم أوالتجربة ) &nbsp;، يُسمح بإضافة لقطات شاشة من الخرائط ولقطات الشاشة التي أجراها المستخدم من الفيديو ، بالإضافة إلى لقطات شاشة لمعلومات الخلفية حول موضوع &quot; تجربتك &quot; ( التقييم أوالتجربة ) &nbsp;.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">يسمح الفن التصويري من الصور ( الصورة التي تتضمن اكثر من صورة في إطار صورة واحدة ) فقط إذا كان يوجد صورة واحدة على الأقل فريدة من نوعها التي قام بإلتقاطها &nbsp;المستخدم المؤلف لـ&quot; تجربتك &quot; ( التقييم أوالتجربة ). مؤلف تجربتك مسؤول عن استخدام صور الآخرين. يُسمح بإضافة الصور المجمعة فقط &nbsp;إذا انها نشرت تحت رخصة تسمح باستخدامها مجانًا لأغراض إعلانية.يجب إنشاء الفيديو مباشرة من قبل المستخدم. يحظر إضافة فيديو لا يتطابق مع اتفاقية المستخدم أو ينتهك حقوق وأخلاقيات الأطراف الثالثة.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">5.5. يحظر نشر تجربتك ( التقييمات &quot; التجارب &quot; ) مقابل رسوم أو هدايا من أطراف ثالثة ، وكذلك في إطار المسابقات أو العروض الترويجية التي تقوم بها أطراف ثالثة.<br />\r\n5.6. يحق للمستخدم إضافة صورة القسيمة النقدية لتجربتك&nbsp; ( التقييم أوالتجربة ) (بما في ذلك التحقق من السجل النقدي عبر الإنترنت) كوثيقة تؤكد شراء السلع / الخدمات. أيضاً ، كوثائق داعمة لكتابة تجربتك كما و يُسمح بتحميل صور تذاكر السينما والمسارح والمتاحف والحفلات الموسيقية والأحداث الرياضية ، إلخ. يجب أن تحتوي الوثائق الداعمة على اسم المنتج أو الخدمة (مكتوبة بحروف عربية و / أو باللغة الإنجليزية) ، السعر ، وكذلك تفاصيل الشيك وإصداره. يتم نشر الوثائق الداعمة على صفحة &quot; تجربتك &quot; ( التقييم أوالتجربة ) الخاصة بالمستخدم ( المؤلف ).</span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:20px\"><span dir=\"RTL\"><strong>6. الحقوق المترتبة على &quot; تجربتك &quot; و التعليقات</strong></span></span><br />\r\n<span dir=\"RTL\">1.6. ينشئ المستخدم تطوعياً &quot; تجربتك &quot; ( التقييم أوالتجربة ) و / أو تعليقات لإستخدامها كجزء من الموقع ويقوم بتنفيذ إجراءات لنشر &quot; تجربتك &quot; ( التقييم أوالتجربة ) و / أو التعليقات على الموقع.<br />\r\n2.6. يجب أن لا تنتهك &quot; تجربتك &quot; ( التقييم أوالتجربة ) والتعليقات حقوق الأطراف الثالثة وحرياتها ومصالحها ، ويجب ألا تحتوي على معلومات وبيانات زائفة عن عمد تشوه شرف ,كرامة وسمعة الأطراف الثالثة (بما في ذلك الجهات القانونية أو الجهات المنتجة للمنتجات السلع أو الخدمات) ، ويجب ألا تنتهك الحقوق والأخلاق والقيم المتعارف عليها عالمياً.</span><br />\r\n&nbsp;<span dir=\"RTL\">3.6. من لحظة نشر &quot; تجربتك &quot; ( التقييم أوالتجربة ) و / أو التعليق على الموقع الإلكتروني ، يعطي المستخدم&nbsp; المسؤول &nbsp;الحق الحصري بالكامل لكل &quot; تجربتك &quot; ( التقييم أوالتجربة ) و / أو تعليق تم إنشاؤه و / أو نشره من قبل المستخدم على الموقع بالتصرف به نشره أو حذفه أو تحريره ( ليتناسب مع القسم الذي يجب ان توجد فيه , ذلك لا يعني تغيير فعلي لا جزئياً ولا كاملاً لما كتبه المستخدم ). يحق للمستخدم نشر &quot; تجربتك &quot; ( التقييم أوالتجربة ) في مدونته / مصادره الأخرى في موعد أقصاه أسبوعين بعد نشر &quot; تجربتك &quot; ( التقييم أوالتجربة )على الموقع.<br />\r\n4.6. النظر إلى حقيقة أن &quot; تجربتك &quot; ( التقييم أوالتجربة ) والتعليقات جزء لا يتجزأ من الموقع ، لا يمكن حذفها وسحبها من قبل المستخدم. في هذه الحالة ، في حالة عدم إمتثال &quot; تجربتك &quot; ( التقييم أوالتجربة ) و / أو التعليق مع المتطلبات المحددة في البند 5 من الاتفاقية ، يحق للمسؤول إزالة هذا &quot; تجربتك &quot; ( التقييم أوالتجربة ) و / أو التعليق بشكل مستقل دون الرجوع إلى المستخدم.</span><br />\r\n&nbsp;<span dir=\"RTL\">5.6. يمنح المستخدم إذن المسؤول للقيام بـ :</span><br />\r\n&nbsp;<span dir=\"RTL\">1.5.6. نشر &quot; تجربتك &quot; ( التقييم أوالتجربة ) على الموقع بالتزامن مع تجارب ( تقييمات) أخرى تتعلق بنفس المنتج.</span><br />\r\n&nbsp;<span dir=\"RTL\">2.5.6. استخدام&quot; تجربتك &quot; ( التقييم أوالتجربة ) بالتزامن مع التعليقات ، بصرف النظر عن القيمة الفنية لمثل هذه التعليقات.<br />\r\n&nbsp;<br />\r\n<span style=\"font-size:20px\"><strong>7. بيانات المستخدم الشخصية</strong></span><br />\r\n1.7.</span> <span dir=\"RTL\">يوافق المستخدم للمسؤول على معالجة البيانات الشخصية المتفق عليها في إتفاقية المستخدم ( شروط الإستخدام) ، بما في ذلك:<br />\r\n1.1.7 الاسم الكامل.<br />\r\n2.1.7 عنوان البريد الإكتروني.<br />\r\n3.1.7 البلد ومدينة الإقامة.<br />\r\n4.1.7 رقم المحفظة الإلكترونية ( الفيزا او الباي بال ) المستخدمة في أنظمة الدفع.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&nbsp;2.7. الإجراءات المتخذة في استخدام المعلومات الشخصية من قبل المسؤول والتي يتم تلقيها من مستخدمي الموقع موجودة في سياسة الخصوصية المتاحة للمستخدمين على الإنترنت على عنوان الشبكة</span><br />\r\n<a href=\"https://tajrobtak.com/information/rules\">https://tajrobtak.com/information/rules</a></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&nbsp;3.7. يحق للمدير نقل معلومات عن المستخدم إلى أطراف ثالثة إذا كان هذا النقل ضروريًا للمسؤول للوفاء بإلتزامات المستخدم بموجب الإتفاقية.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">4.7. معالجة البيانات الشخصية تعني &nbsp;التسجيل ، والتنظيم ، والتراكم ، والتخزين ، والتحسين (التحديث ، التغيير) ، والاستخراج ، والاستخدام ، والنقل (التوزيع ، والتوفير ، والوصول) ، بما في ذلك عبر الحدود ، وإلغاء الطابع الشخصي ، والحجب ، والحذف اما تدمير البيانات الشخصية لا تخضع لفئات خاصة للمعالجة &nbsp;و هذا الأمر يتطلب موافقة خطية من المستخدم.</span></p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">5.7. يتم تنفيذ معالجة البيانات الشخصية من أجل الوفاء بالتزامات مدير الموقع بموجب الاتفاقية ، وتزويد المستخدم بالدعم الفني ، ومراجعة طلبات الاستئناف ومطالبات المستخدمين ، وإرسال رسائل إعلامية إلى عنوان البريد الإلكتروني للمستخدمين ، بالإضافة إلى رسالة تأكيد للتسجيل على الموقع وتنفيذ إجراءات أخرى على الموقع من قبل بعض الأفراد المستخدمين.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">6.7. يجوز للمستخدم في أي وقت سحب موافقته على معالجة البيانات الشخصية ، وكذلك حذف أو تغيير بياناته الشخصية عن طريق مراسلة &quot;المسؤول&quot; من عنوان البريد الإلكتروني الخاص بالمستخدم الذي تم استخدامه أثناء التسجيل على الموقع إلى عنوان البريد الإلكتروني الخاص بالمسؤول</span><br />\r\n<strong><u>info@tajrobtak.com</u></strong><br />\r\n<span dir=\"RTL\">في الوقت نفسه ، يدرك المستخدم أن المسؤول لديه الحق في الاستمرار في استخدام هذه المعلومات في الحالات التي يسمح بها القانون المعمول به.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">7.7. تشير المعلومات الفنية إلى المعلومات التي يتم نقلها تلقائيًا إلى المسؤول أثناء استخدام الموقع باستخدام برنامج مثبت على جهاز المستخدم. المعلومات الفنية ليست ببيانات شخصية. يستخدم المسؤول ملفات تعريف الارتباط ( الكوكيز )والتقنيات المشابهة لتحديد جهاز المستخدم. ملفات تعريف الارتباط ( الكوكيز) هي ملفات نصية متاحة للخدمة لمعالجة المعلومات المتعلقة بنشاط جهاز المستخدم. يمكن للمستخدم تعطيل استخدام ملفات تعريف الارتباط في إعدادات المتصفح الخاص بالمستخدم على جهازه الخاص به.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&nbsp;</span><span dir=\"RTL\">8.7. يحق للمسؤول تقديم معلومات عن المستخدم إلى وكالات تنفيذ القانون أو الوكالات الحكومية الأخرى في إطار العملية القضائية أو في إطار تحقيق على أساس قرار محكمة أو طلب قابل للإنفاذ أو للتعاون مع هذه الجهات ، وكذلك في الحالات الأخرى المنصوص عليها في القانونين السارية المعمول به.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">9.7. يحق للمسؤول تقديم معلومات حول المستخدم إلى أطراف ثالثة لتحديد وإزالة الأعمال الاحتيالية ، لإصلاح المشكلات الفنية أو مشاكل أمنية تتعلق بالموقع.</span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:20px\"><strong><span dir=\"RTL\">8. الملكية الفكرية والقيود أثناء استخدام الموقع</span></strong></span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.8. يحتوي الموقع على نتائج النشاط الفكري الخاص بالمدير و ملكيته الفردية ، والشركات التابعة له ، والأطراف الأخرى ذات الصلة ، والجهات الراعية ، والشركاء ، والممثلين ، وجميع الأشخاص الآخرين الذين يعملون نيابة عن مدير البرنامج ، والأطراف الثالثة الأخرى.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">2.8. عند القيام باستخدام الموقع ( تصفح الموقع أو استخدامه كمستخدم ) ، يقر المستخدم ويوافق على أن محتويات الموقع بالكامل وهيكل محتويات الموقع محمية بموجب حقوق النشر وحقوق الملكية الفكرية ، وأن هذه الحقوق صالحة ومحمية بجميع أشكالها ، على جميع المستويات و الوسائط. فيما يتعلق بجميع التقنيات الموجودة حاليًا والمتقدمة أو التي تم إنشاؤها بعد ذلك. لا يتم نقل أي حقوق إلى أي محتوى في الموقع إلى المستخدم كنتيجة لاستخدام الموقع والدخول في الاتفاقية.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">3.8. لتجنب الشك ، يُحظر على المستخدم :</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.3.8. نسخ و / أو توزيع أي من عناصر حقوق الملكية الفكرية ، المنشورة على الموقع ، ما لم يتلقى إذنًا كتابيًا من المسؤول.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">2.3.8. استخدام المعلومات التي تم الحصول عليها على الموقع للأنشطة التجارية أو الربح أو استخدامها بشكل يتعارض مع القانون.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">3.3.8. نسخ ، أو استخدام جزء من برمجة الموقع ، بالإضافة إلى تصميمه.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">4.3.8. وضع البيانات الشخصية لأطراف ثالثة على الموقع ، دون موافقتهم ، بما في ذلك عناوين المنازل ، وأرقام الهواتف ، وبيانات جواز السفر ، وعناوين البريد الإلكتروني.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">5.3.8. تغيير ، بأي شكل من الأشكال ، جزء من برمجة الموقع ، أو اتخاذ إجراءات تهدف إلى تغيير أداء فاعلية و فعالية الموقع.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">6.3.8. استخدام إجراءات هجومية ومخالفة على حقوق وحريات الأطراف الثالثة أو مجموعة من الأطراف الثالثة كاسم المستخدم ومعلومات الحسابات الأخرى ، بالإضافة إلى تحميل الصور &nbsp;كالصور الشخصية الخاصة بالمتسخدميين بطريقة تخالف معايير الأخلاق العامة.</span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:20px\"><strong><span dir=\"RTL\">9. شروط إستثنائية</span></strong></span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.9. قد يحتوي الموقع على روابط لمواقع أخرى على الإنترنت (مواقع أطراف ثالثة). لا يتم التحقق من هذه الجهات الخارجية ومحتواها من قبل المسؤول أو قدرتها على الامتثال لأي متطلبات (الدقة والاكتمال والشرعية وما إلى ذلك). لا يتحمل المسؤول المسؤولية عن أي معلومات أو مواد منشورة على مواقع أطراف ثالثة يحصل المستخدم على إمكانية الوصول إليها باستخدام موقع تجربتك ، بما في ذلك أي آراء أو بيانات يتم التعبير عنها على مواقع الطرف الثالث والإعلانات وغيرها ، بالإضافة إلى توفر مثل هذه المواقع أو محتواها وعواقب استخدامها من قبل المستخدم.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">2.9. لا يضمن المسؤول أن الموقع سوف يفي بمتطلبات المستخدم ، وسيتم توفير الوصول إلى الموقع بشكل مستمر وسريع وموثوق به وبدون أخطاء.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">3.9. الأخطاء البرمجية او التقنية , سواء من جانب المسؤول أو من جانب المستخدم ، والتي قد تؤدي إلى عدم قدرة المستخدم على الوصول إلى الموقع و / أو الحساب الشخصي ، هي ظروف قاهرة و لا يمكن استدانتها للإعفاء من المسؤولية عن عدم الوفاء بالتزامات المسؤول بموجب الاتفاقية.</span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:20px\"><strong><span dir=\"RTL\">10. المسؤولييات</span></strong></span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.10. يلتزم المستخدم في غضون 7 (سبعة) أيام تقويمية للرد على طلب ( رسالة ) المنتج أو الموزع للمنتج ، على أساس &quot; تجربتك &quot; ( التقييم أوالتجربة ) التي قام بنشرها ، على وجه الخصوص يجب تحديد رقم طلب المنتج ( الخدمة) &nbsp;، التاريخ ، العنوان الذي يتلقى فيه المستخدم المنتج. يمكن مراسلة الشركة المصنعة أو الموزع والإستجابةللمستخدم &nbsp;باستخدام التعليقات أو الرسائل في الحساب الشخصي &nbsp;. يلتزم المستخدم بالرد على الرسائل فقط من الحسابات المؤكدة للممثلين الرسميين للمنظمات (انظر الفقرة 10.3).</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">2.10. في حالة رفض المستخدم تقديم بيانات التعريف إلى ممثل الشركة ، يلتزم المستخدم بتقديم المستندات الداعمة مباشرةً إلى إدارة الموقع عند طلبها. تتعهد إدارة الموقع بعدم الإفصاح عن المعلومات الواردة من المستخدم وعدم نقلها إلى أطراف ثالثة ، باستثناء الحالات المنصوص عليها مسبقاً .</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">3.10. لتعيين حالة اللمثل الرسمي لشركة او لجهة معينة تمتلك حساب شخصي , فإنه من الضروري إرسال رسالة رسمية إلى خدمة دعم الموقع&nbsp; باستخدام الأوراق الرسمية للمنظمة , و التي تأكد أن الحساب المسجل حقاً ينتمي لها و لممثلها. الرسالة يجب أن تكون مختومة و تحتوي على التفاصيل الرئيسية عن الشركة او الجهة المعينة ( الأسم الكامل , الموقع المسجل , الخ ) . بعد التأكد , سوف يكون مسجل و موثق و يحمل حالة أنه الممتثل الرسمي لهذه الجهة او الشركة . نموذج رسالة . </span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">4.10. تقتصر سلطة ممثلي الشركة أو الجهات المعينة على قواعد الموقع. لا يُمنح الممثلون الرسميون للشركات الحق في إجراء تعديلات على &quot; تجربتك &quot; ( التقييم أوالتجربة ) الخاصة بالمستخدميين. في حالة انتهاك قواعد الموقع ، قد يتم حظر الحساب.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">5.10. يحق للمسؤول حذف &quot; تجربتك &quot; ( التقييم أوالتجربة ) &nbsp;في حالة :</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.5.10. انتهاك واحدة على الأقل من متطلبات الإلغاء المحددة في القسم 5 من الاتفاقية.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">2.5.10. انتهاك من قبل المستخدم للفقرة 8.3 من الاتفاق.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">3.5.10. إذا تم نشر &quot; تجربتك &quot; ( التقييم أوالتجربة ) &nbsp;بشكل ينتهك قواعد إنشاء كتالوج للمنتجات على الموقع.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">4.5.10. إذا كان التقييم &quot; تجربتك &quot; ( التقييم أوالتجربة ) &nbsp;تحتوي على إهانات وتهديدات لشخص ما أو لدعوات للعنف.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">6.10. يحق للمسؤول حظر حساب مستخدم إذا :</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.6.10. أنشأ المستخدم عدة حسابات.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&nbsp;2.6.10. نشر المستخدم &quot; تجربتك &quot; ( التقييم أوالتجربة ) &nbsp;/ تعليقاً يحتوي على إهانات وتهديدات شخص ما أو للتحريض</span>&nbsp;<span dir=\"RTL\"> على العنف.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">3.6.10. إذا علمت إدارة الموقع أن المستخدم هو شخص يقل عمره عن 16 عامًا.</span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:20px\"><strong><span dir=\"RTL\">11.إجراءات &nbsp;حل الخلافات</span></strong></span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.11. جميع النزاعات والخلافات والمطالبات التي قد تنشأ فيما يتعلق بتنفيذ أو إنهاء الاتفاقية أو إبطالها ، ستسعى الأطراف إلى حلها من خلال المفاوضات. يرسل الطرف صاحب المطالبات و / أو الخلافات رسالة إلى الطرف الآخر تشير إلى أي مطالبات و / أو خلافات نشأت.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">2.11. في حالة عدم وجود استجابة للرسالة الواردة من الطرف المستجيب إلى الطرف الذي أرسل الرسالة خلال 30 (ثلاثين) يوم عمل من تاريخ إرسال الرسالة ، أو إذا لم يأت الأطراف إلى اتفاق بشأن أي مطالبات و / أو النزاعات التي نشأت ، يجب حل النزاع في عن طريق المحكمة في المكان الذي يوجد به المسؤول. </span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:20px\"><strong><span dir=\"RTL\">12. التغييرات على شروط الاتفاقية</span></strong></span></p>\r\n\r\n<p style=\"text-align:right\">&nbsp;<span dir=\"RTL\">1.12. يحق للمدير تغيير بنود الاتفاقية من جانبه بشكل مستقل وحده ، وسوف يسري مفعول هذه التغييرات عند انتهاء 3 (ثلاثة) أيام من تاريخ نشر الإصدار الجديد من الاتفاقية. </span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">2.12. في كل زيارة لاحقة للموقع من المستخدميين قبل لحظة بدء استخدام الموقع والحساب الشخصي ، يتعهد المستخدم بالتعرف على النسخة الجديدة من الاتفاقية. سيشير الاستخدام المستمر للموقع والحساب الشخصي إلى موافقة المستخدم على بنود الإصدار الجديد من الاتفاقية.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">3.12. إذا كان المستخدم لا يوافق على شروط الإصدار الجديد من الاتفاقية ، فإنه يتوقف عن استخدام الموقع.</span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:20px\"><strong><span dir=\"RTL\">13. الأحكام الختامية</span></strong></span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">1.13. الإتفاقية و العلاقات بين الأطراف المنبثقة عنها تمتثل لأحكام الدستور الأردني, و الخلافات تحل ضمن نطاق احكام دستور المملكة الأردنية الهاشمية.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">2.13.&nbsp; لا يترتب على اعتراف المحكمة بأي حكم من أحكام الاتفاقية بأنه غير صالح أو غير قابل للتنفيذ بعدم صحة أحكام أخرى من الاتفاقية.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&nbsp;3.13. تقاعس المسؤول عن العمل في حالة حدوث انتهاك من جانب أي من المستخدمين لأحكام الاتفاقية لا يحرم المدير من الحق في اتخاذ الإجراءات المناسبة في وقت لاحق دفاعًا عن اهتماماته وحماية الحقوق الفكرية للموقع و عناصر الموقع بموجب القانون.</span></p>\r\n\r\n<p style=\"text-align:right\"><span dir=\"RTL\">&nbsp;4.13. يؤكد المستخدم أنه قد قرأ جميع أحكام الاتفاقية ، وأنه فهمها و قبلها.</span></p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n');
INSERT INTO `yy_information_content` (`id`, `information_id`, `lang`, `title`, `content`) VALUES
(6, 3, 'en', 'Rules', '<div>\r\n<p>The&nbsp;site administrator&nbsp;<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>, on the one hand, and the Internet user, who accepted the offer placed on the Internet at the network address&nbsp;<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>/information/rules, have entered into this agreement as follows.</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">1. Terms and definitions</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>1.1. In this User Agreement, unless the text expressly states otherwise, the following terms will have the following meanings:</p>\r\n</div>\r\n\r\n<div>\r\n<p>&ldquo;Administrator&rdquo; - a legal entity that is the administrator of the domain name&nbsp;<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a></p>\r\n</div>\r\n\r\n<div>\r\n<p>&ldquo;Comments&rdquo; is a work created by the User specifically for use in conjunction with Reviews, which is subjected&nbsp;to&nbsp;copyright.</p>\r\n</div>\r\n\r\n<div>\r\n<p>&quot;Personal Account&quot; - a collection of secure pages of the Site created as a result of the registration of the User, using which the User has the ability to change and supplement their data, receive and edit other information provided by the functional features of the Site.</p>\r\n</div>\r\n\r\n<div>\r\n<p>&ldquo;Review&rdquo; is a work created by users of the Site that is subjected&nbsp;to&nbsp;copyright.</p>\r\n</div>\r\n\r\n<div>\r\n<p>&ldquo;User&rdquo; - a person who has entered into an Agreement with the Administrator by accepting an offer located on the Internet at the&nbsp;network address&nbsp;<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>/information/rules. The&nbsp;Site&nbsp;user&nbsp;cannot&nbsp;be a person under the age of 16 years.</p>\r\n</div>\r\n\r\n<div>\r\n<p>&ldquo;Site&rdquo; - a collection of information, texts,&nbsp;graphics&nbsp;elements, design, images, photos and video materials and other intellectual property, as well as computer programs contained in the information system ensuring the availability of such information on the Internet at the network address&nbsp;<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a><a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>.</p>\r\n</div>\r\n\r\n<div>\r\n<p>The area of ​​the Site available at the network addresses&nbsp;<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>, or at other network addresses, but within the domain zone&nbsp;<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>, is&nbsp;a&nbsp;created&nbsp;complex object which is organized by the Administrator.</p>\r\n</div>\r\n\r\n<div>\r\n<p>&quot;Agreement&quot; - This User Agreement.</p>\r\n</div>\r\n\r\n<div>\r\n<p>&quot;Parties&quot; - Administrator and User.</p>\r\n</div>\r\n\r\n<div>\r\n<p>1.2. All other terms and definitions found in the text of the Agreement are interpreted by the Parties in accordance with the legislation of the Russian Federation and the usual rules of interpretation of the relevant terms established on the Internet.</p>\r\n</div>\r\n\r\n<div>\r\n<p>1.3. The titles of the headings (articles) of the Agreement are intended solely for the convenience of using the text of the Agreement and have no literal legal meaning.</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">2. The procedure for concluding an agreement</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>2.1. The text of this Agreement&nbsp;is permanently posted&nbsp;on the Site at the network address&nbsp;<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>/information/pravila, contains all the essential conditions and is a public offer.</p>\r\n</div>\r\n\r\n<div>\r\n<p>2.2. The proper acceptance of the Offer is considered to be the consistent implementation of the following actions by the User:</p>\r\n</div>\r\n\r\n<div>\r\n<p>2.2.1. Familiarization with the terms of the Agreement;</p>\r\n</div>\r\n\r\n<div>\r\n<p>2.2.2. Entering accurate and up-to-date information as credentials (user login, email address, password with repeated confirmation) and&nbsp;digital&nbsp;code (captcha) in the registration form, located on the link &quot;Registration&quot; on the Site;</p>\r\n</div>\r\n\r\n<div>\r\n<p>2.2.3. Putting the symbol in a special field under the heading &quot;I accept the&quot; User Agreement &quot;and&quot; Rules of the Partner Program &quot;in the completed registration form;</p>\r\n</div>\r\n\r\n<div>\r\n<p>2.2.4. Pressing the &quot;Register&quot; button in the completed registration form;</p>\r\n</div>\r\n\r\n<div>\r\n<p>2.3. From the moment the actions specified in clause 2.2 of the Agreement are made, the offer is considered&nbsp;acceptable, and the Agreement is concluded on the conditions specified below.</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">3.&nbsp;The subject&nbsp;of the Agreement</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>3.1 The Administrator provides the User with the opportunity to access the Site, the right to create and publish reviews, receive the latest information about new comments&nbsp;about&nbsp;selected user reviews, post comments, and the User transfers the exclusive rights to&nbsp;the administrator to&nbsp;create the user reviews and comments.</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">&nbsp;4. The procedure for using the Site</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>4.1. Prior to registration, the Administrator provides any person, including a person who&nbsp;later has&nbsp;&nbsp;performed the actions specified in the Agreement to become&nbsp; a&nbsp;User, access to the Site, information on the Site, including Reviews and Comments, without the ability to leave Comments and use other functions of the Site and Personal account&nbsp;which is&nbsp;available to users.</p>\r\n</div>\r\n\r\n<div>\r\n<p>4.2. After registration, the User is granted access to the Personal Account using credentials -&nbsp;login&nbsp;and password.</p>\r\n</div>\r\n\r\n<div>\r\n<p>4.3. Using the functions available in the Personal Account, the User gets the opportunity to:</p>\r\n</div>\r\n\r\n<div>\r\n<p>4.3.1.&nbsp;Change&nbsp;credentials (email address and password), add an image, subject to the provisions of clause 8.3.6 of the Agreement, and otherwise, change and manage User data in the Personal Account provided for by the user interface of the Personal Account;</p>\r\n</div>\r\n\r\n<div>\r\n<p>4.3.2. Exchange personal messages with other users of the Site;</p>\r\n</div>\r\n\r\n<div>\r\n<p>4.3.3.&nbsp;Subscribe to&nbsp;reviews&nbsp;and receive information and, if applicable, notifications to the email address of the User&nbsp;which was&nbsp;specified during registration on the Site, about new comments added by users of the Site about the Review&nbsp;which the User&nbsp;already&nbsp;subscribed on&nbsp;the Personal Account;</p>\r\n</div>\r\n\r\n<div>\r\n<p>4.3.4. Publish reviews and comments;</p>\r\n</div>\r\n\r\n<div>\r\n<p>4.4. It is the responsibility of the User to ensure the safety and security of the password to third parties. In case of loss or compromise of the password, as well as in the case of misappropriation by third parties to access personal account, the User is obliged to immediately notify the administrator by e-mail&nbsp;info@<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>. Until such a message is received, all actions performed from the User&rsquo;s Personal Account will be considered as completed by the User himself.</p>\r\n</div>\r\n\r\n<div>\r\n<p>4.5. The User is obliged to use the Site and the Personal Cabinet in good faith, without violating the rights and freedoms of third parties, the norms of morality and&nbsp;ethics, without using hardware or technical means that can make changes to the work of the Site and Personal Cabinet that are not provided during their normal use. In particular, the User undertakes not to post on the Site information that violates the rights and interests of third parties. The User is solely responsible for any illegal actions committed by the User using the Site.</p>\r\n</div>\r\n\r\n<div>\r\n<p><span style=\"font-size:14px\"><strong>5. Review Requirements</strong></span></p>\r\n</div>\r\n\r\n<div>\r\n<p>5.1.&nbsp;Reviews&nbsp;should be devoted to a specific Product,&nbsp;while it&rsquo;s&nbsp;present at the time of the preparation of the&nbsp;Review&nbsp;on the market and available to the mass consumer. The user undertakes to indicate the full name of the product, which includes an indication of the type of product, brand and product name. The type of goods is indicated only in&nbsp;Arabic or English.&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2. It is not allowed to post reviews dedicated to:</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.1. Unique Products, including homemade and made-to-order&nbsp;products;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.2. Rare Products, including Antique Products;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.3. Products made in violation of the law, including counterfeit Products;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.4. Sexual products;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.5.&nbsp;Gambling-related&nbsp;products;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.6. Products&nbsp;that&nbsp;are&nbsp;similar or&nbsp;analogically&nbsp;similar in&nbsp;the&nbsp;purpose&nbsp;of&nbsp;the Site;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.7.&nbsp;Products/sites&nbsp;that violate copyright law;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.8. Products intended to deceive users,&nbsp;advertising products&nbsp;and others (sites with paid surveys, clicks, likes, reposts, surfing, etc.);</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.9. Actions or methods of actions,&nbsp;that&nbsp;indirectly relates&nbsp;to the Product, including recipes;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.10. Specific individuals with their name and other personal data, regardless of their relationship with the Products;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.11.&nbsp;Youtube&nbsp;personal pages and channels with fewer than 200,000 subscribers;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.12.&nbsp;Politics and politicians;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.13. Perfumes are not in the original packaging (otlivantam);</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.14. Probers of the caring cosmetics, if the volume of the probe is insufficient to assess the result;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.2.15.&nbsp;Caring&nbsp;cosmetics, diets, cosmetics&nbsp;and/or&nbsp;surgical procedures, if after application of the procedure or insufficient time has passed for the evaluation result.</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.3.&nbsp;Reviews&nbsp;should be:</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.3.1. Creative,&nbsp;which means, the User is obliged to create a Review with his own personal creative work without the involvement of third parties in the creation of the Feedback&nbsp;&ldquo;Review&rdquo;;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.3.2. Subjective, which means, the User must create a Review solely&nbsp;based on a&nbsp;personal experience&nbsp;of&nbsp;using the Product;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.3.3.&nbsp;Reliable,&nbsp;which means, do not contain deliberately false information about the Product;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.3.4. Evaluative,&nbsp;which means, the&nbsp;feedback &ldquo;Review&rdquo;&nbsp;must contain the opinion of the User on the properties of the Product, and the Review should not contain information discrediting the honor of the dignity and reputation of third parties (including legal&nbsp;parties), should not violate the rights,&nbsp;morality,&nbsp;and&nbsp;ethics.</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.3.5. Unique,&nbsp;which means, the User has no right to post a Review on the Site that repeats or&nbsp;based on&nbsp;another&nbsp;User&rsquo;s previously published work;</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.3.6. Informative,&nbsp;which means, the User must reflect in the Review the main consumer properties of the Product, but&nbsp;without&nbsp;affecting&nbsp;the consumer properties of the Product to other Users,&nbsp;which includes&nbsp;not disclose the content of films and books.</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.4.&nbsp;The&nbsp;Photographic work as a part of the review&nbsp;must be in jpg, jpeg,&nbsp;png&nbsp;formats, the maximum download size is 20 MB. Photos in the review should be unique, high-quality, clear, relate to the topic of the review. It is forbidden to use images from the Internet. Distortion of the results of product use in&nbsp;graphics&nbsp;editors is unacceptable. In&nbsp;reviews,&nbsp;it is allowed to add screenshots of maps, screenshots made by the User from the video, as well as screenshots of background information on the subject of the review.</p>\r\n</div>\r\n\r\n<div>\r\n<p>Collages from images are allowed only if they have at least one unique photo taken by the author. The author of the review is responsible for the use of other people&#39;s photos. It is allowed to add to the&nbsp;collages&nbsp;only photos published under licenses allowing their free use for commercial purposes.</p>\r\n</div>\r\n\r\n<div>\r\n<p>The video must be created directly by the user. It is forbidden to add&nbsp;a&nbsp;video&nbsp;that does not match the user agreement or violate the&nbsp;rights and ethics of the third parties.</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.5. It is forbidden to post reviews for a fee or gifts from third parties, as well as in the framework of contests or promotions held by third parties.</p>\r\n</div>\r\n\r\n<div>\r\n<p>5.6. The user has the right to add to the&nbsp;review&nbsp;image of the cash voucher (including the check of the online cash register) as a document confirming the purchase of&nbsp;goods/services. Also, as supporting documents it is allowed to upload photos of tickets to the cinema, theaters, museums, concerts,&nbsp;sports&nbsp;events, etc. Supporting documents must contain the name of the product or service (written in&nbsp;Arabic&nbsp;and/or&nbsp;English letters), the price, as well as the details of the check and issuing organization. Supporting documents are published on the review page.</p>\r\n</div>\r\n\r\n<div>\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">6. Rights&nbsp;of&nbsp;Reviews&nbsp;and Comments</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>6.1. The user voluntarily creates reviews&nbsp;and/or&nbsp;comments for use as part of the Site and performs actions to publish Reviews&nbsp;and/or&nbsp;Comments on the Site.</p>\r\n</div>\r\n\r\n<div>\r\n<p>6.2. Reviews and Comments should not violate the rights, freedoms,&nbsp;and&nbsp;interests of third parties, should not contain deliberately false information and information discrediting the honor of the dignity and reputation of third parties (including legal&nbsp;parties), and should not violate the&nbsp;rights, morality,&nbsp;and&nbsp;ethics.</p>\r\n</div>\r\n\r\n<div>\r\n<p>6.3. From the moment of the publication of the&nbsp;Review&nbsp;and/or&nbsp;Comment on the Website, the User donates (alienates) the&nbsp;Administrator&nbsp;the exclusive right in full for each Review&nbsp;and/or&nbsp;Comment created&nbsp;and/or&nbsp;published by the User on the Website. The user has the right to post a Review in his blog / other sources no earlier than two weeks after the publication of the review on the Site.</p>\r\n</div>\r\n\r\n<div>\r\n<p>6.4. Due to the fact that the Reviews and Comments are an integral part of the Site, they cannot be deleted and withdrawn by the User. In this case, in the case of non-compliance of the Feedback&nbsp;and/or&nbsp;Comment with the requirements specified in clause 5 of the Agreement, the Administrator has the right to remove such Feedback&nbsp;and/or&nbsp;Comment independently.</p>\r\n</div>\r\n\r\n<div>\r\n<p>6.5. The user gives the Administrator permission:</p>\r\n</div>\r\n\r\n<div>\r\n<p>6.5.1.&nbsp;Post a Review on the Site in conjunction with other Reviews related to the same Product;</p>\r\n</div>\r\n\r\n<div>\r\n<p>6.5.2.&nbsp;Use&nbsp;Review&nbsp;in conjunction with Comments, regardless of the artistic value of such Comments.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">7. User Personal Data</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>7.1. The user agrees to the Administrator for the processing of personal data provided at the conclusion of the Agreement, including:</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.1.1. Full Name;</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.1.2. E-mail address;</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.1.3. Country and city of residence;</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.1.4. User&#39;s electronic wallet number in payment systems.</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.2. The procedure&nbsp;of using personal information&nbsp;by the&nbsp;Administrator which is&nbsp;received from users of the Site&nbsp;is set out in the privacy policy that is available to Users on the Internet at the network address&nbsp;<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>/information/politikakonfidentsialnosti.</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.3. The Administrator has the right to transfer information about the User to third&nbsp;parties&nbsp;if such transfer is necessary for the Administrator to fulfill&nbsp;the user&rsquo;s&nbsp;obligations&nbsp;under the Agreement.</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.4. The processing of personal data means the recording, systematization, accumulation, storage, refinement (update, change), extraction, use, transfer (distribution, provision, access), including cross-border, depersonalization, blocking, deletion, destruction of personal data that are not subject to special categories for the processing which&nbsp;requires a written consent of the User.</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.5. Processing of personal data is carried out in order to fulfill the Administrator&rsquo;s obligations under the Agreement, provide the User with technical support, review appeals and claims of Users, send informational messages to the User&rsquo;s email address, as well as confirming&nbsp;the registration on the Site and performing&nbsp;other actions on the Site by certain individuals&nbsp;&ldquo;Users&rdquo;.</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.6. The User may at any time withdraw consent to the processing of personal data, as well as delete or change their personal data by sending the Administrator a notification from the User&rsquo;s email address specified during registration on the Site to the Administrator&#39;s email address&nbsp;info@<a href=\"/\" title=\"Tajrobtak.com\">Tajrobtak.com</a>.&nbsp;At the same time, the User understands that the Administrator has the right to continue using such information in cases permitted by applicable law.</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.7. Technical information refers to information that is automatically transmitted to the Administrator during the use of the Site using software installed on the User&rsquo;s device. Technical information is not personal data. The administrator uses cookies and similar technologies to identify the User&rsquo;s device. Cookies are text files available to the Service to process information about the activity of the User&rsquo;s device. The user can disable the use of cookies in the browser settings.</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.8. The administrator has the right to provide information about the User to law enforcement agencies or&nbsp;other governmental&nbsp;agencies&nbsp;in the framework of the judicial process or within the framework of the investigation on the basis of a court decision,&nbsp;an enforceable request or by way of cooperation, as well as in other cases stipulated by applicable law.</p>\r\n</div>\r\n\r\n<div>\r\n<p>7.9. The administrator has the right to provide information about the User to third parties in order to identify and suppress fraudulent actions, to fix technical problems or security problems.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p><span style=\"font-size:14px\"><strong>8. Intellectual property and limitations&nbsp;while&nbsp;using the Site</strong></span></p>\r\n</div>\r\n\r\n<div>\r\n<p>8.1. The site contains the results of intellectual activity belonging to the Administrator,&nbsp;its&nbsp;affiliates and other related parties, sponsors, partners, representatives, all other persons acting on behalf of the Administrator, and other third parties.</p>\r\n</div>\r\n\r\n<div>\r\n<p>8.2. By using the Site, the User acknowledges and agrees that the entire contents of the Site and the structure of the contents of the Site are protected by copyright, intellectual property&nbsp;rights,&nbsp;and that these rights are valid and protected in all forms, on all media in relation to all technologies as currently existing and developed or created&nbsp;afterward. No rights to any content of the Site are transferred to the User as a result of using the Site and entering into the Agreement.</p>\r\n</div>\r\n\r\n<div>\r\n<p>8.3. For the avoidance of doubt, the User is prohibited from:</p>\r\n</div>\r\n\r\n<div>\r\n<p>8.3.1. Coping&nbsp;and/or&nbsp;distributing&nbsp;any of the objects of intellectual property rights, posted on the Site, unless&nbsp;they have received&nbsp;written&nbsp;permission by the administrator;</p>\r\n</div>\r\n\r\n<div>\r\n<p>8.3.2.&nbsp;Using&nbsp;the information obtained on the Site for commercial activities, profit,&nbsp;or using it&nbsp;inconsistent with law;</p>\r\n</div>\r\n\r\n<div>\r\n<p>8.3.3.&nbsp;Coping, or otherwise using&nbsp;the programming&nbsp;part of the Site, as well as its design;</p>\r\n</div>\r\n\r\n<div>\r\n<p>8.3.4. Placing&nbsp;on the Site personal data of third parties, without their consent, including home addresses, phone numbers, passport data, email addresses;</p>\r\n</div>\r\n\r\n<div>\r\n<p>8.3.5. Changing, in any way, the programming&nbsp;part of the Site,&nbsp;or/and&nbsp;taking&nbsp;actions aimed at changing the functioning and operation of the Site;</p>\r\n</div>\r\n\r\n<div>\r\n<p>8.3.6.&nbsp;Using&nbsp;offensive&nbsp;and violating&nbsp;actions&nbsp;on the&nbsp;rights and freedoms of third parties and groups of words as the user name and other account information, as well as upload images as avatars that violate&nbsp;norms of&nbsp;public morality.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">9. Special conditions</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>9.1. The site may contain links to other sites on the Internet (third party sites). These third parties and their content are not checked by the Administrator for compliance with any requirements (accuracy, completeness, legality, etc.). The Administrator is not responsible for any information, materials posted on third-party sites to which the User gets access using the Site, including for any opinions or statements expressed on third-party sites, advertising, etc., as well as for the availability of such sites or content and the consequences of their use by the User.</p>\r\n</div>\r\n\r\n<div>\r\n<p>9.2. The Administrator does not guarantee that the Site meets the requirements of the User, that access to the Site will be provided continuously, quickly, reliably and without errors.</p>\r\n</div>\r\n\r\n<div>\r\n<p>9.3. Software and hardware errors, both on the Administrator&rsquo;s side and on the User&rsquo;s side,&nbsp;which might result&nbsp;in the inability of the User to access the Site&nbsp;and/or&nbsp;Personal Account, are circumstances of insuperable force and grounds for exemption from liability for non-fulfillment&nbsp;the&nbsp;obligations by the Administrator under the Agreement.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">10. Responsibility</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>10.1. The User is obliged within 7 (seven) calendar days to respond to the request of the manufacturer or distributor of the Product, based on the&nbsp;Review, in particular, specify the order number, date, address&nbsp;where&nbsp;the User&nbsp;receives&nbsp;the Product. The request of the manufacturer or distributor and the response of the User can be sent using the Comments or messages in the Dashboard. The user is obliged to respond to requests only from confirmed accounts of official representatives of organizations (see paragraph 10.3).</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.2. In case of user&rsquo;s refusal to provide identification data to the company representative, the user is obliged to provide supporting documents directly to the Site Administration upon request. The site administration undertakes not to disclose and not to transfer to third parties the information received from the user, with the&nbsp;exception of cases provided for.</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.3. To assign the status of an official representative of a company to an organization that owns an account, it is necessary to send an official letter to the site&rsquo;s support service on the organization&rsquo;s&nbsp;letterhead, from which it follows that the registered login really belongs to the company&#39;s representative. The letter must be stamped and contain the main details of the organization (full name, TIN, legal address, etc.). After verification, the account is marked as confirmed and receives the status of the official representative of the&nbsp;brand/company.&nbsp;Sample letter.</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.4.&nbsp;The Power of&nbsp;the&nbsp;company&rsquo;s&nbsp;official&#39;s&nbsp;representatives&nbsp;is&nbsp;limited by the Site Rules. Official representatives of companies are not given the right to moderate reviews. In case of violation of the Site Rules, the account may be blocked.</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.5. The administrator has the right to delete Review&nbsp;in the case of:</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.5.1.&nbsp;Violation of at least one of the requirements for revocation specified in section 5 of the Agreement;</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.5.2.&nbsp;Violation by the User of clause 8.3 of the Agreement;</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.5.3.&nbsp;If&nbsp;the Review is published in violation of the rules for constructing a catalog of Products on the Site;</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.5.4. If the&nbsp;Review&nbsp;contains insults and threats to someone&rsquo;s address or calls for&nbsp;violence.</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.6. The Administrator has the right to block a user account if:</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.6.1. The user has created several accounts;</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.6.2. The user has posted a Review \\ comment containing insults and threats to someone&rsquo;s address or incitement to violence.</p>\r\n</div>\r\n\r\n<div>\r\n<p>10.6.3. The administration has learned that&nbsp;the User&nbsp;is a person under the age of 16 years.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">11. Dispute Resolution Procedure</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>11.1. All disputes, disagreements,&nbsp;and&nbsp;claims that may arise in connection with the execution, termination or invalidation of the Agreement, the Parties will seek to resolve through negotiations. The party with claims&nbsp;and/or&nbsp;disagreements sends a message to the other Party indicating any claims&nbsp;and/or&nbsp;disagreements that have arisen.</p>\r\n</div>\r\n\r\n<div>\r\n<p>11.2.&nbsp;In case, there was no&nbsp;response&nbsp;to the message from&nbsp;the responding Party&nbsp;to&nbsp;the Party that sent the message within 30 (thirty) working days from the date the corresponding message was sent, or if the Parties do not come to an agreement on any claims&nbsp;and/or&nbsp;disputes that have arisen, the dispute must be resolved in court finding the Administrator.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">12. Changes to the terms of the Agreement</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>12.1. The administrator has the right to unilaterally change the terms of the Agreement, and such changes will take effect upon&nbsp;the&nbsp;expiration&nbsp;of 3 (three) days from the date of publication of the new version of the Agreement.</p>\r\n</div>\r\n\r\n<div>\r\n<p>12.2. At each subsequent visit to the Site prior to the&nbsp;moment of start using&nbsp;the Site and the Personal Account, the User undertakes to get acquainted with the new version of the Agreement. Continued use of the Site and Personal Account will indicate the User&rsquo;s consent to the terms of the new version of the Agreement.</p>\r\n</div>\r\n\r\n<div>\r\n<p>12.3. If the User does not agree with the terms of the new version of the Agreement, he ceases to use the Site.</p>\r\n</div>\r\n\r\n<div>\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong><span style=\"font-size:14px\">13. Final provisions</span></strong></p>\r\n</div>\r\n\r\n<div>\r\n<p>13.1. The agreement and all legal relations arising from it are regulated without regard to its conflict of laws rules. All disputes arising are resolved.</p>\r\n</div>\r\n\r\n<div>\r\n<p>13.2. The recognition by the court of any provision of the Agreement as invalid or not enforceable does not entail the invalidity of other provisions of the Agreement.</p>\r\n</div>\r\n\r\n<div>\r\n<p>13.3. Inaction on the part of the Administrator in the event of a violation by any of the Users of the provisions of the Agreement does not deprive the Administrator of the right to take later appropriate actions in defense of their interests and protection of intellectual rights to the Site materials protected by law.</p>\r\n</div>\r\n\r\n<div>\r\n<p>13.4. The user confirms that he has read all the provisions of the Agreement, understood&nbsp;and accepted&nbsp;them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n'),
(9, 6, 'en', 'PARTNERSHIP AGREEMENT IN THE PARTNERSHIP PROGRAM', '<p>Tajrobtak, an entity acting on its own behalf and at its own expense, on the one hand (hereinafter referred to as the Organizer), and accepting an offer hosted on the Internet at <a href=\"/information/pp\" title=\"\">http://Tajrobtak.com/information/pp</a>, an Internet user (hereinafter referred to as the User), has entered into this partnership agreement. </p><p>1. Terms and definitions </p><p>1.1. In this partnership program agreement, unless the text expressly states otherwise, the following terms will have the following meanings: </p><p>“Site” - Website located at <a href=\"/\" title=\"tajrobtak\">Tajrobtak.com</a> </p><p>\"Active Account\" is the Account of the User who had published at least 1 Review on the Site in the last 30 (thirty) calendar days. </p><p>“Review” is a literary work or a complex object, including literary and photographic works, created by the User in accordance with the Program, containing the User’s opinion about the Product. </p><p>“Product” means a product, service, company, place (travel destination), an Internet site or another similar product which the User creates a Review about. </p><p>\"Program\" - This agreement on participation in the affiliate program. </p><p>\"View\" - Visiting the Site page with feedback. </p><p>1.2. All other terms and definitions found in the text of the Program are interpreted by the Parties in accordance with the Agreement and the usual rules of interpretation of the relevant terms established on the Internet. </p><p>1.3. The titles (articles) of the Program are intended solely for the convenience of using the text of the Program and have no literal legal meaning. </p><p>2. The order of conclusion the program </p><p>2.1. The text of the Program is permanently posted on the Site at the network address <a href=\"/information/pp\" title=\"\">http://Tajrobtak.com/information/pp</a>, contains all the essential conditions and is a public offer.  </p><p>2.2. Appropriate acceptance of the offer is considered to be the consistent implementation of the following actions by the User: </p><p>2.2.1. Acquaintance with the terms of the Program and registration on the Site; </p><p>2.2.2. Pressing the button “Add your review” on the Website or the button “Write a review” in the Personal Account. </p><p>2.3. From the moment of performing the actions specified in clause 2.2 of the Program, the offer is considered as accepted, and the terms of the Program are binding on the User. </p><p>2.4. The Organizer has the right to change the terms of the Program at any time, and the user is obliged to get acquainted with the Program before publishing each new Review, while publishing a new Review it will mean that the User accepts new conditions of the Program. In case of disagreement of the User with the new terms of the Program, the User does not have the right to publish new Reviews, while, if the amount of remuneration is not less than 150 cents, the User has the right to contact the Organizer to withdraw funds remaining in the User’s account in accordance with the Program terms. </p><p>3. The subject of the Program </p><p>3.1. The purpose of the Affiliate program is to attract users and increase site traffic. </p><p>3.2. The User creates a review in accordance with the requirements of the Organizer specified in Section 4 of the Program, and the Organizer pays the User remuneration in accordance with the terms of the Program. </p><p>4. Review Requirements </p><p>4.1. Reviews should be devoted to a specific Product, which is present at the time of the preparation of the Review on the market and available to the mass consumer. The user undertakes to indicate the full name of the product, which includes an indication of the type of product, brand and product name. </p><p>4.2. Reviews should be issued in accordance with the requirements of the Administration of the site <a href=\"/\" title=\"tajrobtak\">Tajrobtak.com</a> </p><p>4.3. The volume of the literary work in the composition of the Review for admission to publish must be at least 50 words. </p><p> </p><p>5. User\'s remuneration and payment procedure </p><p>5.1. The user receives the following types of remuneration: </p><p>5.1.1. Bonuses for posting reviews. The size of the bonus depends on the product/service category, the number of other reviews per topic, the quality, relevance, and usefulness of the review. The bonus is calculated within 7 days after the publication of the review. The greatest bonuses are awarded for reviews in the following categories: “Beauty and Health”, “Auto”, “Technique”, “Finance”, “Tourism”. </p><p>5.1.2. Charges to the author for viewing reviews by other users of the site - 50 cents for every 1,000 (thousand) views. </p><p>5.1.3. Charges for viewing reviews of authors who registered using the user\'s individual promotional code as part of the “Refer a Friend” program - 20% of charges for viewing reviews of specified users. </p><p>5.1.4. One-time charge in the amount of 50 cents in the case of registration using the promotional code of another user. </p><p>5.1.5. Charges for participation in public moderation. </p><p>5.2. Remuneration for views is charged during the entire time a review is posted on the Site, provided that the user account is active. Remuneration is not charged if the User’s account ceases to be Active. Remuneration is not charged for reviews of less than 500 characters. </p><p>5.3. The Organizer keeps a record of the amount of the User’s remuneration, and information about the amount of the remuneration is available to the User in the Personal Account. The organizer updates information about the amount of remuneration of the User with an Active account once a day. If the User, whose account was not active, publishes a new Review, then his account is activated again. At the same time, for the payment of remuneration, views on previously published Reviews, received during the period when the user account was not active, are not accepted for calculation. </p><p>5.4. If the User’s remuneration amount is 10 (ten) dollars, the Organizer pays the amount calculated in accordance with clause 6.1 of the Program to the purse specified by the User in the billing page by the PayPal or Visa card number. The organizer pays a reward only on the basis of the application of the User, containing the details of the PayPal or Visa card of the User, performed in the Personal Account in the “Billing” section. </p><p>5.5. The user is solely responsible for the correctness of the wallet number “Paypal or Visa number” specified in the personal account. The transfer of remuneration according to the details specified in the User’s Personal Account is recognized by the Organizer’s proper payment obligation. All costs associated with the transfer of remuneration and withdrawal of the specified amount from the WebMoney wallet, QIWI or transferring by using PayPal or Visa card number, the User pays on his own. </p><p>5.6. The remuneration is not paid for the published Review, which was recognized by the Organizer as non-compliant with the requirements specified in Section 4. The Organizer may make this decision, including on the basis of negative ratings and comments from other Members. </p><p> </p><p> </p><p> </p><p>6. Counting Views </p><p>6.1. Counting Views occurs automatically when using the Site’s software and the User agrees with the accuracy and reliability of such a calculation. </p><p>6.2. Views counting is suspended in the case when the User\'s account is no longer active and resumes after its re-activation. </p><p>6.3. When calculating Views are not counted if: </p><p>6.3.1. Views of the User who published the Review; </p><p>6.3.2. Repeated views of Users; </p><p>6.3.3. The views received as a result of the actions of the User referred to in clause 6.4 of the Program. </p><p>6.4. The user is prohibited from: </p><p>6.4.1. Increasing the number of views by visiting his own Review from another computer; </p><p>6.4.2. Increasing the number of views using spam and paid visitation systems; </p><p>6.4.3. Increasing the number of views using any technical means; </p><p>6.4.4. Using referral/affiliate links and codes in the Review; only direct links are allowed; </p><p>6.4.5. Contact someone with a request to view all User Reviews, including through Comments; </p><p>6.4.6. Post references to the Review in violation of clause 6.5 of the Program. </p><p>6.5. The user is allowed to post links to User Review: </p><p>6.5.1. In messages addressed to friends and acquaintances; </p><p>6.5.2. On the User’s blog, on personal pages on social networks. </p><p>6.5.3. In discussion forums, including the signature of the User, if the subject of the review corresponds to the topic being discussed on the forum. </p>');
INSERT INTO `yy_information_content` (`id`, `information_id`, `lang`, `title`, `content`) VALUES
(10, 6, 'ar', 'اتفاقية الشراكة في برنامج الشركاء', '<p dir=\"rtl\"><span dir=\"RTL\">تجربتك كيان يعمل لحسابه الخاص وعلى نفقته الخاصة ، من جهة (يشار إليه فيما يلي باسم المنظم) ، ويقبل&nbsp; عرضًا مستضافًا على الإنترنت على&nbsp; </span><a href=\"/information/pp\" title=\"\">http://Tajrobtak.com/information/pp</a><span dir=\"RTL\"> ومستخدم الإنترنت من جهة أخرى (يشار إليها فيما يلي باسم المستخدم) ، قد دخلا في اتفاقية الشراكة هذه</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1. التعريفات و الشروط</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">&nbsp;1.1. في اتفاقية برنامج الشراكة هذه ، ما لم ينص النص صراحة على خلاف ذلك ، فإن المصطلحات التالية ستكون لها المعاني التالية:</span></p>\r\n\r\n<p dir=\"rtl\">&nbsp;<span dir=\"RTL\">&quot;الموقع&quot; : موقع إلكتروني في </span><a href=\"/\" title=\"tajrobtak\">Tajrobtak.com</a></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">&quot; الحساب النشط &quot; : هو حساب المستخدم الذي نشر ما لا يقل عن &quot;تجربتك &quot; ( التقييم أو التجربة ) واحدة على الموقع في آخر 30 (ثلاثين) يومًا تقويميًا.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">&quot; تجربتك &quot; : او يمكن الإشارة له بـ &quot; التجربة &quot; أو &quot; المراجعة &quot; أو &quot; التقييم &quot; , هو عمل ( يتكون من صور و / أو نصوص ) قام بإنشاءه مستخدميين الموقع الذين يعبرون به عن رأيهم الشخصي بمنتج أو خدمة او سلعة أو وجهة سفر أو كتاب قرأه إلى اخره و الذي يخضع لحقوق الطبع و النشر.</span></p>\r\n\r\n<p dir=\"rtl\">&quot;<span dir=\"RTL\">&quot;المنتج&quot; : يعني المنتج أو الخدمة أو الشركة أو المكان (وجهة السفر) أو موقع إنترنت أو منتج آخر مماثل يقوم المستخدم بإنشاء &quot;تجربتك &quot; ( التقييم أو التجربة ) عنه.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">&quot;البرنامج&quot; : الإتفاقية الحالية للدخول في برنامج الشراكة.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">&quot;مشاهدة&quot; : زيارة صفحة الموقع و التجارب ( التقييمات , تجربتك ).</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">&nbsp;2.1. جميع الشروط و التعريفات الموجودة في نص هذه الإتفاقية فسرت من قبل الأطراف وفقاً للقواعد المعتادة لقواعد تفسير مصطلحات الشروط ذات الصلة المعترف بها على الإنترنت.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">3.1. عنواين المقالات لهذه الإتفاقية تهدف فقط لتسهيل فهم نص هذه الإتفاقية و لا تحمل أي معنى قانوني حرفياً.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">2. الإجراءات المتخذة لدخول البرنامج</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1.2. نص هذه الإتفاقية منشور بشكل دائم على الموقع على الرابط الإلكتروني </span><a href=\"/information/pp\" title=\"\">http://Tajrobtak.com/information/pp</a><span dir=\"RTL\"> و الذي يحتوي على جميع الشروط الأساسية و هو عرض عام يمكن لجميع مستخدمي الأنترنت الوصول إليه و الإطلاع عليه.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">2.2. يعتبر القبول المناسب للعرض هو بالتنفيذ المنسق للإجراءات التالية بواسطة المستخدم :</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1.2.2. التعرف على شروط البرنامج والتسجيل على الموقع.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">&nbsp;2.2.2. الضغط على زر &quot;إضافة تقييم&quot; أو &quot; إضافة تجربة &quot; على موقع الويب أو على زر &quot;كتابة تقييم&quot; أو &quot; كتابة تجربة &quot; في الحساب الشخصي.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">3.2. اعتبارًا من لحظة تنفيذ الإجراءات المحددة في الفقرة 2.2 من البرنامج ، يعتبر العرض مقبولاً ، وتكون شروط البرنامج ملزمة على المستخدم.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">4.2. يحق للجهة المنظمة تغيير شروط البرنامج في أي وقت ، ويجب على المستخدم التعرف على البرنامج و شروطه قبل نشر كل </span><span dir=\"RTL\">&quot;تجربتك &quot; ( التقييم أو التجربة </span><span dir=\"RTL\">جديدة ، في حين أن نشر </span><span dir=\"RTL\">&quot;تجربتك &quot; ( التقييم أو التجربة )</span><span dir=\"RTL\"> جديدة يعني أن المستخدم قبل بالشروط الجديدة للبرنامج. في حالة عدم موافقة المستخدم على الشروط الجديدة للبرنامج ، لا يمتلك المستخدم الحق في نشر تقييمات جديدة ، و إذا كان لا يقل مبلغ الذي كسبه المستخدم عن 10 دولارات ، يحق للمستخدم الاتصال بالمسؤول. سحب الأموال المتبقية في حساب المستخدم وفقًا لشروط البرنامج.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">3.موضوع البرنامج</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1.3. الغرض من برنامج الشركاء هو جذب المستخدمين وزيادة عدد زيارات الموقع.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">2.3. ينشئ المستخدم </span><span dir=\"RTL\">&quot;تجربتك &quot; ( التقييم أو التجربة ) </span><span dir=\"RTL\">وفقًا لمتطلبات المسؤول المحددة في القسم 4 من البرنامج ، ويدفع المسؤول مكافأة المستخدم وفقًا لشروط البرنامج.</span>&nbsp;</p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">4. متطلبات &quot;تجربتك &quot; ( التقييم أو التجربة )</span></p>\r\n\r\n<p dir=\"rtl\">&nbsp;<span dir=\"RTL\">1.4. يجب تخصيص &quot;تجربتك &quot; ( التقييم أو التجربة ) لمنتج معين على ان يكون المنتج \\ موجود في وقت إعداد التقييم في السوق ومتاح بشكل شامل للمستهلكين يتعهد المستخدم للإشارة إلى الاسم الكامل للمنتج ، والذي يتضمن إشارة إلى نوع المنتج والعلامة التجارية واسم المنتج.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">2.4. يجب إصدار &quot;تجربتك &quot; ( التقييم أو التجربة ) وفقًا لمتطلبات إدارة موقع </span><a href=\"/\" title=\"tajrobtak\">Tajrobtak.com</a></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">3.4. يجب أن يكون حجم العمل الأدبي في تكوين &quot;تجربتك &quot; ( التقييم أو التجربة ) للقبول على نشره 50 كلمة على الأقل.</span></p>\r\n\r\n<p dir=\"rtl\">&nbsp;<span dir=\"RTL\">5. مكافأة المستخدم وإجراءات الدفع</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1.5. يتلقى المستخدم الأنواع التالية من الأجور:</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1.1.5. مشاهدات لنشر &quot;تجربتك &quot; ( التقييم أو التجربة ). يعتمد عدد المشاهدات على فئة المنتج / الخدمة ، وعدد التقييمات الأخرى لكل موضوع ، والجودة ،&nbsp; وفائدة التقييم . يتم الحصول على اكبر عدد من المشاهدات للتقييمات في الفئات التالية: &quot;الجمال والصحة&quot; ، &quot;السيارات&quot; ، &quot;التقنية&quot; ،&nbsp; &quot;السياحة&quot;.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">2.1.5. الدفع للمستخدم على كتابة التقييم &quot;تجربتك &quot; ( التقييم أو التجربة ) الحاصل على مشاهدات و استعراضات المستخدميين الأخرين للموقع لها , 50 ( خمسين ) سنت مقابل 1000 مشاهدة للتقيم.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">3.1.5. الدفع للمستخدم بنسبة 20% من دخل المستخدمين الأخرين عن طريق المشاهدات للتجارب و التقييمات الخاصة بهم في حال تسجيلهم بإدخال الكود الترويجي الفردي الخاص بالمستخدم و الموجود في الحساب الشخصي للمتسخدم, تسمى هذه الخاصية ب &quot; الإحالة لصديق &quot;.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">4.1.5. يتم الدفع مرة واحد للمستخدم عند استخدام كود ترويجي لمستخدم اخر بقيمة 50 (خمسين) سنت .</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">5.1.5. الدفع للمستخدمين النشيطيين , المساعديين, الذيين يقومون بالموافقة على أن &quot;تجربتك&quot; لا تخالف اي من قواعد او قوانيين الموقع و يمكن نشرها.</span></p>\r\n\r\n<p dir=\"rtl\">&nbsp;<span dir=\"RTL\">2.5. يتم تحصيل المكافأت مقابل المشاهدات طوال الفترة التي يتم فيها نشر &quot; تجربتك &quot; على الموقع ، شريطة أن يكون حساب المستخدم نشطًا. لا يتم عملية دفع المكافأة إذا توقف حساب المستخدم عن أن يكون نشطًا. لا يتم دفع مكافأة &nbsp;لـ &quot; تجربتك &quot; التي تقل عن 500 حرف.</span></p>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\">&nbsp;<span dir=\"RTL\">3.5. يحتفظ المسؤول بسجل لمبلغ مكافأة المستخدم ، وتتوفر معلومات حول مبلغ المكافأة للمستخدم في الحساب الشخصي. يقوم المنظم بتحديث معلومات حول مبلغ مكافأة المستخدم في الحساب الشخصي مرة واحدة في اليوم. إذا قام المستخدم ، الذي لم يكن حسابه نشطًا ، بنشر مراجعة جديدة ، فسيتم تنشيط حسابه مرة أخرى. وفي الوقت نفسه ، لا يتم قبول المشاهدات الخاصة بـ &quot; تجربتك &quot; التي حصل عليها المستخدم خلال الفترة التي لم يكن فيها حساب المستخدم نشطاً.</span></p>\r\n\r\n<p dir=\"rtl\">&nbsp;<span dir=\"RTL\">4.5 ذا كان مبلغ مكافأة المستخدم 10 (10) دولارات ، يدفع المنظم المبلغ المحسوب وفقًا للبند 6.1 من البرنامج إلى المحفظة المحددة بواسطة المستخدم في صفحة الفوترة بواسطة رقم بطاقة </span>PayPal or Visa card<br />\r\n<span dir=\"RTL\">دفع المنظم مكافأة فقط على أساس </span><span dir=\"RTL\">طلب مسبق من &nbsp;المستخدم ، و في الطلب يجب ان يتوفر رقم البطاقة </span>PayPal or Visa card<span dir=\"RTL\"> الخاصة بالمستخدم ، هذا الطلب يتم تنفيذه في الحساب الشخصي في قسم &quot; الفواتير&quot; .</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">5.5. يكون المستخدم وحده مسؤولاً عن صحة رقم البطاقة </span>PayPal or Visa card<br />\r\n<span dir=\"RTL\">المحددة في الحساب الشخصي عند تقديم الطلب في خانة &quot; الفواتير &quot; , يتم تحويل المكافأة المبلغ المالي وفق التفاصيل المحددة في الطلب الذي يقوم به المستخدم في حسابه الشخصي و بإلتزام المسؤول عن عملية الدفع عند توفر الشروط كاملة لذلك , أما عن التكاليف المرتبطة بنقل المكافأت المالية و تحويل المبالغ المالية فيدفعها المستخدم من تلقاء نفسه. </span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">6.5. لا يتم دفع المكافأة المالية أو المبلغ المالي لـ &quot; تجربتك &quot; في حين إكتشاف أنها لا تتفق مع الشروط و المتطلبات في القسم 4 . المسؤول لديه القدرة في إتخاذ مثل هذا القرار بالنظر إلى التقييمات و التعليقات السلبية من المستخدميين الأخرين.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">6. عدد المشاهدات</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1.6. يتم عد المشاهدات تلقائياً من برجمة الموقع و المستخدم مقر بفعالية و واقعية هذه العملية.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">2.6. عداد المشاهدات يتوقف في حال أصبح المستخدم &quot; مستخدم غير نشط &quot; و تستمر عند استعادة الحساب نشاطه اي عندما يصبح المستخدم نشط مرة أخرى.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">3.6. يتوقف عد المشاهدات في الحالات التالية :</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1.3.6. المشاهدات التي يقوم بها المستخدم لـ &quot; تجربتك &quot; التي قام بنشرها.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">2.3.6. المشاهدات المتكررة من المستخدميين لـ &quot; تجربتك &quot;.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">3.3.6. المشاهدات الناتجة عن أعمال يقوم بها المستخدم في الفقرة 4.6 من هذه الإتفاقية.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">4.6. يمنع المستخدم من القيام بالأعمال التالية:</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1.4.6. زيادة عدد المشاهدات لـ &quot; تجربتك &quot; بالدخول إليها من أجهزة كمبيوتر أخرى.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">2.4.6. زيادة عدد المشاهدات باستخدام أنظمة البريد المزعج والزيارات المدفوعة.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">3.4.6. زيادة عدد المشاهدات باستخدام أي وسائل تقنية.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">4.4.6. استخدام الإحالة / الروابط التابعة والرموز في &quot; تجربتك &quot; ؛ يسمح فقط بإستخدام الروابط المباشرة.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">5.4.6. الاتصال بشخص ما أو إرسال رسالة لطلب مشاهدة جميع &quot; تجربتك &quot; للمستخدم أو الطلب من خلال التعليقات.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">6.4.6. نشر روابط / مراجع لـ &quot; تجربتك &quot; بطريقة مخالفة للفقرة 6.5 من هذه الإتفاقية.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">5.6. يسمح للمستخدم بنشر روابط / مراجع لـ &quot; تجربتك &quot; في الحالات التالية :</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">1.5.6. في الرسائل الموجهة للأصدقاء و المعارف.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">2.5.6. على مدونة المستخدم ، على صفحاته الشخصية على مواقع التواصل الإجتماعي.</span></p>\r\n\r\n<p dir=\"rtl\"><span dir=\"RTL\">3.5.6. في المنتديات النقاشية ، بما في ذلك توقيع المستخدم ، إذا كان موضوع &quot; تجربتك &quot; يناظر الموضوع الجاري مناقشته في المنتدى.</span></p>\r\n'),
(11, 7, 'en', 'Advertising on the site Tajrobtak.com', '<p>Our advertising server can be targeted on any sections of the site, on geography, set the frequency and much more. </p>\r\n\r\n<p>Tajrobtak.com is the place where buyers make a purchasing decision. Each month millions of users from the Middle East and the Arabic countries visit Tajrobtak.com, the largest site for reviews on the Arabic Internet.  </p>\r\n\r\n<p>The site contains objective and independent information. Real buyers post on the site reviews on various products and services, upload photos and share experiences. The most popular sections are \"Beauty and Health\" and \"Auto\", as well as thousands of reviews on telephones, hotels, travel agencies and many other topics. </p>\r\n\r\n<p>The site audience is potential buyers who want to learn more about the product before making a purchasing decision. </p>\r\n\r\n<p>Advertising can be targeted by site sections, user geography, and other parameters. </p>\r\n\r\n<p>All questions and suggestions on advertising please send to <a href=\"mailto:info@Tajrobtak.com\" title=\"Send Email\">info@Tajrobtak.com</a></p>'),
(12, 7, 'ar', 'الإعلان على موقع تجربتك', '<p style=\"text-align: right;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">هو المكان الذي يتخذ فيه المشترون قرار الشراء, كل شهر ملايين المستخدميين من الشرق الأوسط و الدول العربية يقومون بزيارة تجربتك , الذي يعد أكبر موقع للتجارب في الإنترنت العربي.<br />\r\nالموقع فضاء يحتوي على كم هائل من المعلومات الموضعية والمستقلة .&nbsp; مشتروون حقيقيون للمنتجات ينشرون &quot; تجربتك &quot; على الموقع عن خدمات و منتجات عديدة , كما و يقومون بتحميل الصور و مشاركة الخبرات . أكثر الأقسام زيارة و شهرة &quot; الجمال و الصحة &quot; , &quot; التلفونات &quot; , &quot; السيارات &quot; , و &quot; السياحة &quot; , و الألاف من التجارب عن الفنادق وجهات السفر و العدييد من المواضيع الأخرى.<br />\r\nجمهور الموقع يتكون من اشخاص لديهم النية للقيام بعملية شراء و يريدون المعرفة اكثر عن المنتج قبل إتخاذ قرار الشراء.<br />\r\n<br />\r\nالإعلانات يمكنها استهداف اي قسم في الموقع , نسبةً للمستخدمين و لموقعهم الجغرافي و العديد من العوامل الأخرى.</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">كل الأسئلة و الإقتراحات عن الإعلانات الرجاء إرسالها للبريد الإلكتروني المبين ادناه</span></p>\r\n\r\n<p style=\"text-align: right;\"><a href=\"mailto:info@Tajrobtak.com\" title=\"Send Email\">info@Tajrobtak.com</a></p>\r\n'),
(13, 8, 'en', 'Privacy policy', '<p>1. Terms and concepts </p><p>When you use the site Tajrobtak.com (hereinafter referred to as the \"Site\") owned by Tajrobtak LTD (hereinafter referred to as \"we\", \"Company\"), we receive and process various types of data, including personal data (hereinafter referred to as \"Personal Information \"). In addition, we interact with your personal information in the course of executing agreements and contracts concluded with you in connection with your using of the Site (see sections \"Affiliate Program\", \"User Agreement\") </p><p>2. Contact details </p><p>Your personal information is processed by the Company Tajrobtak LTD </p><p>3. Purpose of the Privacy Policy </p><p>Protection of your personal data and your privacy is one of the priorities of the Company. </p><p>In this section, we want to highlight the following points as transparently as possible regarding the processing of your data: </p><p>1) Why and in what way does the Company process personal information? </p><p>2) What responsibilities do we assume as an entity? </p><p>3) How you can control the amount of information processed? </p><p>4) What are your rights within the framework of the processing of Personal Information? </p><p>4. What information we collect </p><p>It largely depends on whether you use an account to access the site or view it as anonymous. In the first case, the Personal Information collected by us in the course of your own using of the site can be compared and linked to the information you provided in your account (gender, age, contact details, etc.). This information is not verified; we cannot judge its authenticity or whether you have sufficient legal capacity to represent it. By default, we assume that you provide accurate information and update it in time. </p><p> </p><p>We collect the following types of information: </p><p>1) Personal information that you enter when creating an account, for example, your username and email address; </p><p>2) Electronic data (HTTP headers, IP address, cookies, web beacons/pixel tags, browser ID data, hardware, and software information); </p><p>3) The date and time of the site visit; </p><p>4) Information about your preferences regarding the use of the Site (for example, the visited pages of the Site, the “review useful” marks, bookmarks, etc.); </p><p>5) To make payments to users, information is requested on the payee, such as full name, e-wallet number; PayPal or visa card number. </p><p>6) Other types of information that is necessary to maintain the functioning of the site and the fulfillment of our obligations. </p><p>We use cookies and web beacons (including pixel tags) to collect Personal Information that is associated with your device and browser (see section 11 of this Policy). </p><p>We never collect information about racial origins, political preferences, health, and biometric data or other types of sensitive information. If you wish, you can provide them to the Company, in which case we will process them within the framework of providing you access to the Site and in accordance with the law. Remember that we cannot request your consent for such processing, because we do not know in advance that you intend to provide us with information of a potentially sensitive nature. </p><p>We do not collect data in order to create a \"portrait\" of the user to the extent that it could violate your rights and freedoms. </p><p>5. Legal basis and objectives </p><p>We use and process your personal information only in the following cases: </p><p>a) To fulfill contractual obligations between you and the Site, including ensuring the operation of the Site; </p><p>b) To fulfill the obligations established by law; </p><p>c) To ensure the legitimate interests of the Company while making sure that your fundamental rights and freedoms are not infringed upon. </p><p>For example, we may process your personal data in order to: </p><p>1) Analyze, improve, change, personalize or otherwise improve the Site in the interests of all users; </p><p>2) To offer services, goods, and services that you may potentially be interested in (showing you ads that match your interests). </p><p>3) For other more specific purposes, we may request additional consent to the processing of your Personal Information. </p><p>We process Personal Information only for specific purposes and only to achieve goals. For example, to: </p><p>a) Providing you access to the site; </p><p>b) Providing the ability to restore access to the account; </p><p>c) Ensuring the delivery of notifications or other information relating to the work of the Site, ensuring the implementation of agreements with you and the processing of your requests and requests; </p><p>d) Showing your advertisements and offers based on your preferences and other Personal Information about you available to us; </p><p>e) To make payments to you; </p><p>f) To protect your rights and the rights of the Company. </p><p>6. What measures do we take to protect your privacy? </p><p>In most cases, your personal information is processed programmatically, i.e. automatically, without access to it by a living person. If necessary, access can be granted only to those employees of the Company who need it to perform their specific tasks. Our employees comply with strict internal policies and procedures regarding the processing of Personal Information and undertake to follow all technical and organizational security measures in place to protect your Personal Information. </p><p>We implement and provide specialized technical and organizational measures to protect Personal Information from unauthorized, accidental or unlawful destruction, loss, alteration, unfair use, disclosure or access, as well as other illegal forms of processing. </p><p>7. Who has access to Personal Information and to whom it can be transferred? </p><p>7.1 Within the Company </p><p>Only to our employees - within the limits specified in section 6. In all cases, Personal Information will also be processed only for the purposes listed in section 5, unless otherwise established by the terms of using the Site (see User Agreement). </p><p>7.2 Outside the Company </p><p>The Company may transfer Personal Information to third parties in the following cases: </p><p>1) information about the pages you have visited and electronic data (HTTP headers, IP address, cookies, web beacons/pixel tags, browser identifier data, hardware and software information) can be passed to advertisers or other partners of the Company for showing you ads that match your interests; </p><p>2) Personal information may be transferred to third parties in respect of which made the transfer of rights or obligations, or novation of the relevant agreement;  </p><p>3) Personal information may be transferred to law enforcement or regulatory authorities, other official or state bodies or courts upon request within the framework of the relevant legislation; </p><p>4) Personal information may be transferred to third parties, subject to your consent to the transfer of Personal Information, or if the transfer of information is required to provide you with any service or to fulfill any agreements between you and the Company; </p><p>5) If you violate the Company\'s user agreement or in a situation where there is a threat of such violation, we reserve the right to transfer your personal data to a third party to ensure the legal rights of the Company. </p><p>8. Where your Personal Information is stored and processed? </p><p>The company records, systematizes, accumulates, stores, updates (updates, changes), retrieves personal data using databases located in St. Petersburg on the territory of Russian Federation. </p><p> </p><p>9. Terms of storage of personal information </p><p>We store personal information for no more than the period required to achieve the purpose of collecting information, and/or to comply with the law. </p><p>You can remove Personal Information from your profile at any time using the site interface. </p><p>10. Clarifying Your Rights </p><p>10.1 What rights do you have? </p><p>You have the right to access and edit your Personal Information, which we process in accordance with this policy. </p><p>If you believe that any information that the Company stores about you is incorrect or incomplete, you can log in to your account and correct your Personal Information yourself. </p><p>If this is provided by applicable law, you have the right to: </p><p>- Require the deletion of your Personal Information; </p><p>- Request to limit the processing of your Personal Information; </p><p>- Object to the processing of your Personal Information, if required by applicable law. </p><p>The company will comply with specified requests in accordance with applicable law. </p><p>In cases stipulated by applicable law, you may also have other rights. </p><p>10.2 How to exercise your rights? </p><p>To exercise the above rights, log in to the account on the Site, and in the absence of a special function in the interface, contact us (see section 13). </p><p>If you have comments on the processing of your data, you have the right to send a complaint to the Company through the site form. If you are not satisfied with the Company\'s response, you have the right to file a complaint with the competent authority. </p><p>11. Cookies and similar technologies on the Site </p><p>11.1 What are cookies and why do we use them </p><p> </p><p>Cookies are small text files placed on the device you use to access the Site. They contain information that is stored on your device and sent back to the Site with each subsequent visit in order to remember your actions and preferences after a time. </p><p>We use the following types of cookies: </p><p>- Strictly necessary cookies / technical cookies: these cookies are necessary for the operation of the Site; </p><p>- Statistical/analytical cookies: these cookies allow you to recognize users, count their number and collect information, such as operations you perform on the Site, including information about the web pages you have visited and the content you receive; </p><p>- Technical cookies: these cookies collect information about how users interact with the Site, which allows detecting errors and testing new features to improve the performance of the Site; </p><p>- Functional cookies: these cookies allow you to provide certain functions to facilitate your use of the Site, for example, saving your preferences (such as the location of functional elements and other settings of the site); </p><p>- (third-party) tracking files/advertising cookies: these cookies collect information about users, traffic sources, pages visited and advertisements displayed for you, as well as the one that you went to on the advertised page. They allow you to display ads that may interest you, based on the analysis of the pages you have visited. </p><p>11.2 How long does your device keep cookies? </p><p>We use these files only for the purposes specified above. After that, the collected data is stored on your device for a period, which may depend on the appropriate type of cookies, but not exceeding the time required to perform their function. Then they are automatically removed from your system. </p><p>11.3 Who besides us has access to the information contained in the cookies? </p><p>Information from cookies can be used by the Company or partners of the company (see section 7). On third-party websites, the using of this information for promotional purposes may be subject to separate agreements. We or our partners can provide you with the opportunity to opt out of personalized advertising. </p><p>When you visit the site for the first time, we request your consent to use cookies. If you want to change your mind later, you can simply delete the cookies in your browser. After that, we will again request your consent to use cookies and you can make another choice. If you refuse to use cookies, this may lead to the fact that some functions of the Site will be unavailable for you. </p><p>You can also change your browser settings to accept or decline all cookies or cookies from certain sites, including our site, by default. Consent to use cookies is regarded as your permission to use them. </p><p>The company can also use web beacons (pixel tags) to access cookies previously placed on your device for the following purposes: </p><p>1) Determining your actions on the Site and in the process of using the Services by accessing and using cookies stored on your device; </p><p>2) Collection of statistical information related to the operation of the Site, products, utilities, and suggestions of the Company. </p><p>12. Updates and additions </p><p>The privacy policy might be modified and updated at the discretion of the Company or in the event of a change in applicable laws. We undertake not to make significant changes to the Policy without additional notice, for example, in the form of a banner or pop-up window. Also, notifications of a change in the Privacy Policy can be sent via other channels of communication (for example, via e-mail). </p><p> </p><p> </p><p>13. Feedback </p><p>We will be happy to answer any questions about this Policy. To contact us you can use the form on this page <a href=\"http://Tajrobtak.com/information/support\" title=\"Support\">http://Tajrobtak.com/information/support</a>. If you have any complaints or other important messages regarding the Policy or the processing of your personal information, please also contact us. </p>'),
(14, 8, 'ar', 'سياسة الخصوصية', '<h2 style=\"text-align: right;\"><span dir=\"RTL\">&nbsp;</span><span dir=\"RTL\">1.الشروط والمفاهيم</span></h2>\r\n\r\n<p style=\"text-align: right;\"><br />\r\n<span dir=\"RTL\">&nbsp;( المشار إليه فيما بعد بـ &quot; الموقع &quot; ) المملوك من قبل شركة </span>Tajrobtak.com <span dir=\"RTL\">عند استخدامك لموقع</span><br />\r\n<span dir=\"RTL\">&nbsp;( المشار إليها فيما يلي بـ &quot; نحن &quot; , أو &quot; الشركة &quot; ) </span>Tajrobtak Ltd<br />\r\n<span dir=\"RTL\">فإننا نتلقى ونعالج أنواعًا مختلفة من البيانات ، بما في ذلك البيانات الشخصية (يشار إليها فيما بعد يشار إليها باسم &quot;المعلومات الشخصية&quot;). إضافة إلى ذلك ، نحن نتفاعل مع معلوماتك الشخصية في سياق تنفيذ الاتفاقيات والعقود المبرمة معك فيما يتعلق باستخدامك للموقع (انظر أقسام &quot;برنامج الشراكة&quot; ، &quot;إتفاقية المستخدم&quot; , &quot; شروط الإستخدام &quot; ).</span></p>\r\n\r\n<h2 style=\"text-align: right;\"><span dir=\"RTL\">2. معلومات الإتصال</span></h2>\r\n\r\n<p style=\"text-align: right;\">Tajrobtak LTD <span dir=\"RTL\">تتم معالجة المعلومات الشخصية الخاصة بك من قبل شركة</span></p>\r\n\r\n<h2 style=\"text-align: right;\"><span dir=\"RTL\">3. الغرض من سياسة الخصوصية</span></h2>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">تعتبر حماية بياناتك الشخصية وخصوصيتك واحدة من أولويات الشركة. في هذا القسم ، نريد تسليط الضوء على النقاط التالية بشفافية قدر الإمكان فيما يتعلق بمعالجة بياناتك:</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">1) لماذا وبأي طريقة تقوم الشركة بمعالجة المعلومات الشخصية؟</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">2) ما هي المسؤوليات التي تفرض علينا ككيان يقوم بمعالجة المعلومات الشخصية؟</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">3) كيف يمكنك التحكم في كمية المعلومات التي تتم معالجتها؟</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">4) ما هي حقوقك في إطار معالجة المعلومات الشخصية ؟</span></p>\r\n\r\n<h2 style=\"text-align: right;\">&nbsp;<span dir=\"RTL\">4. ما هي المعلومات التي نجمعها ؟</span></h2>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">يعتمد إلى حد كبير على ما إذا كنت تستخدم حسابًا للوصول إلى الموقع أو كزائرِ للموقع مجهول . في الحالة الأولى ، يمكن مقارنة المعلومات الشخصية التي جمعتها لنا في أثناء قيامك بالتسجيل &nbsp;بالموقع وربطها بالمعلومات التي قدمتها في حسابك (الجنس ، العمر ، تفاصيل الاتصال ، وما إلى ذلك). لا يتم التحقق من هذه المعلومات ؛ لا يمكننا الحكم على صحتها أو ما إذا كان لديك القدرة القانونية الكافية لتمثيلها. بشكل افتراضي ، نفترض أنك تقدم معلومات دقيقة و أنك تقوم بتحديثها في الوقت المناسب.</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">نقوم بجمع الأنواع التالية من المعلومات :&nbsp; </span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">1) &nbsp;المعلومات الشخصية التي تدخلها عند إنشاء حساب ، على سبيل المثال ، اسم المستخدم وعنوان البريد الإلكتروني الخاص بك.</span></p>\r\n\r\n<p dir=\"RTL\">2) البيانات الإلكترونية ( رؤوس <span dir=\"LTR\">HTTP</span> , عنوان <span dir=\"LTR\">IP </span>&nbsp;, ملفات تعريف الارتباط ، منارات الويب / علامات بكسل، البيانات <span dir=\"LTR\">ID</span> المتصفح، والأجهزة، المعلومات البرمجية).</p>\r\n\r\n<p dir=\"RTL\">3) تاريخ ووقت زيارة الموقع.</p>\r\n\r\n<p dir=\"RTL\">4) معلومات حول ميولاتك فيما يتعلق باستخدام الموقع (على سبيل المثال ، الصفحات التي تمت زيارتها في الموقع ، وعلامات &quot;المراجعة المفيدة&quot; ، والإشارات المرجعية ، وما إلى ذلك).</p>\r\n\r\n<p dir=\"RTL\">5) لتقديم مدفوعات إلى المستخدمين ، يتم طلب المعلومات على المستفيد ، مثل الاسم الكامل ورقم المحفظة الإلكترونية ؛ <span dir=\"LTR\">PayPal</span> أو رقم بطاقة الفيزا.</p>\r\n\r\n<p dir=\"RTL\">6) أنواع أخرى من المعلومات اللازمة للحفاظ على عمل الموقع والوفاء بالتزاماتنا.</p>\r\n\r\n<p dir=\"RTL\">نحن نستخدم الكوكيز ومنارات الويب (بما في ذلك علامات بكسل) لجمع المعلومات الشخصية التي ترتبط مع جهازك ومتصفح الخاص بك (انظر المادة 11 من هذه السياسة).</p>\r\n\r\n<p dir=\"RTL\">نحن أبدا لا نجمع المعلومات حول الأصول العرقية والميول السياسية، والصحة، والبيانات البيومترية أو أنواع أخرى من المعلومات الحساسة. إذا كنت ترغب في ذلك، يمكنك تزويدها للشركة، وفي هذه الحالة سوف نقوم بمعالجتها لهم في إطار توفير لك الوصول إلى الموقع وفقا للقانون. تذكر أنه لا يمكننا طلب موافقتك على مثل هذه المعالجة ، لأننا لا نعرف مقدمًا أنك تنوي تزويدنا بمعلومات ذات طبيعة قد تكون حساسة.</p>\r\n\r\n<p dir=\"RTL\">نحن لا نجمع البيانات من أجل إنشاء &quot;صورة&quot; للمستخدم لدرجة أنه يمكن بها إنتهاك حقوقك وحرياتك.</p>\r\n\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n\r\n<h2 style=\"text-align: right;\"><span dir=\"RTL\">5. الأسس القانونية و الأهداف</span></h2>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">نحن نستخدم ونعامل معلوماتك الشخصية فقط في الحالات التالية :</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">أ) الوفاء بالالتزامات التعاقدية بينك وبين الموقع ، بما في ذلك ضمان تشغيل و فعالية الموقع .</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">ب) الوفاء بالالتزامات التي ينص عليها القانون.</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">ج) ضمان المصالح المشروعة للشركة مع التأكد من عدم انتهاك حقوقك وحرياتك الأساسية.</span>.</p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">على سبيل المثال ، قد نقوم بمعالجة بياناتك الشخصية من أجل :</span><span dir=\"RTL\"> </span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">1) تحليل الموقع أو تحسينه أو تغييره أو تخصيصه بأي شكل آخر لمصلحة جميع المستخدمين .</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">2) &nbsp;لتقديم الخدمات والسلع التي قد تكون مهتمًا بها (عرض الإعلانات التي تتوافق مع اهتماماتك) .</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">3) لأغراض أخرى أكثر تحديدًا ، قد نطلب موافقة إضافية لمعالجة معلوماتك الشخصية</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">نقوم بمعالجة المعلومات الشخصية فقط لأغراض محددة ولتحقيق الأهداف فقط. على سبيل المثال :</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">أ) توفير القدرة على الوصول إلى الموقع.</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">ب) توفير القدرة على استعادة الوصول إلى الحساب الشخصي .</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">ج) للتأكد من وصول الإشعارات أو غيرها من المعلومات المتعلقة بعمل الموقع ، وضمان تنفيذ الاتفاقات معك ومعالجة طلباتك. </span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">د) عرض إعلاناتك وعروض اخرى بناءً على اهتماماتك و ميولك والمعلومات الشخصية الأخرى المتوفرة لنا.</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">هـ) للقيام بعمليات دفع المكافأة المالية.</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">و) لحماية حقوقك وحقوق الشركة.</span></p>\r\n\r\n<h2 style=\"text-align: right;\"><span dir=\"RTL\">&nbsp;6. ما هي التدابير التي نتخذها لحماية خصوصيتك؟</span></h2>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">في معظم الحالات ، تتم معالجة معلوماتك الشخصية برمجيًا ، أي تلقائيًا ، دون الوصول إليها بواسطة شخص. إذا لزم الأمر ، لا يمكن منح حق الوصول لمثل هذه المعلومات إلا إلى موظفي الشركة الذين يحتاجون إليها لأداء مهامهم المحددة. يلتزم موظفونا بسياسات وإجراءات داخلية صارمة فيما يتعلق بمعالجة المعلومات الشخصية ويتعهدون باتّباع جميع الإجراءات الأمنية التقنية والتنظيمية المعمول بها لحماية معلوماتك الشخصية.</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">ننفذ ونوفر تدابير فنية وتنظيمية متخصصة لحماية المعلومات الشخصية من التدمير غير المصرح به أو غير المقصود أو غير القانوني ، أو الفقدان ، أو التغيير ، أو الاستخدام غير العادل ، أو الكشف ، أو الوصول إليها ، بالإضافة إلى أشكال المعالجة غير القانونية الأخرى.</span></p>\r\n\r\n<h2 style=\"text-align: right;\"><span dir=\"RTL\">7. من يستطيع الوصول إلى المعلومات الشخصية وإلى من يمكن نقلها ؟</span></h2>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">1.7. داخل الشركة</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">فقط لموظفينا - ضمن الحدود المحددة في القسم 6. في جميع الحالات ، سيتم أيضًا معالجة المعلومات الشخصية فقط للأغراض المذكورة في القسم 5 ، ما لم يتم تحديد خلاف ذلك من خلال شروط استخدام الموقع (راجع اتفاقية المستخدم).</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">2.7. خارج الشركة</span></p>\r\n\r\n<p style=\"text-align: right;\"><span dir=\"RTL\">يجوز للشركة نقل المعلومات الشخصية إلى أطراف ثالثة في الحالات التالية :</span></p>\r\n\r\n<p dir=\"RTL\">1 ) يمكن أن تنتقل المعلومات حول الصفحات التي قمت بزيارتها والبيانات الإلكترونية (رؤوس <span dir=\"LTR\">HTTP</span>، عنوان <span dir=\"LTR\">IP</span>، الكوكيز، منارات الويب / علامات بكسل، وبيانات المتصفح المعرف والأجهزة و المعلومات البرمجية) للمعلنين أو الشركاء الآخرين في الشركة لعرض الإعلانات التي تتطابق مع اهتماماتك.</p>\r\n\r\n<p dir=\"RTL\">2 ) يجوز نقل المعلومات الشخصية إلى أطراف ثالثة فيما يتعلق بنقل الحقوق أو الالتزامات أو تجديد الاتفاقية ذات الصلة.</p>\r\n\r\n<p dir=\"RTL\">3) يجوز نقل المعلومات الشخصية إلى سلطات إنفاذ القانون أو السلطات التنظيمية أو غيرها من الهيئات الرسمية أو الحكومية أو المحاكم بناء على طلبها في إطار التشريعات ذات الصلة.</p>\r\n\r\n<p dir=\"RTL\">4) يجوز نقل المعلومات الشخصية إلى أطراف ثالثة ، رهنا بموافقتك على نقل المعلومات الشخصية ، أو إذا كان نقل المعلومات مطلوبًا لتزويدك بأي خدمة أو الوفاء بأي اتفاقيات بينك وبين الشركة.</p>\r\n\r\n<p dir=\"RTL\">5) إذا قمت بانتهاك اتفاقية المستخدم الخاصة بالشركة أو في حالة وجود تهديد بهذا الانتهاك ، فإننا نحتفظ بالحق في نقل بياناتك الشخصية إلى طرف ثالث لضمان الحقوق القانونية للشركة.</p>\r\n\r\n<h2 dir=\"RTL\">8. أين يتم تخزين ومعالجة معلوماتك الشخصية؟</h2>\r\n\r\n<p dir=\"RTL\">تقوم الشركة بتسجيل ، وتنظيم ، وتراكم ، ومخازن ، وتحديثات (تحديثات ، تغييرات) ، واسترداد البيانات الشخصية باستخدام قواعد البيانات الموجودة في سانت بطرسبرغ على أراضي روسيا الإتحادية.</p>\r\n\r\n<h2 dir=\"RTL\">9. شروط تخزين المعلومات الشخصية</h2>\r\n\r\n<p dir=\"RTL\">نقوم بتخزين المعلومات الشخصية لمدة لا تزيد عن الفترة المطلوبة لتحقيق الغرض من جمع المعلومات و / أو للامتثال بها إذا لزم أمام القانون.</p>\r\n\r\n<p dir=\"RTL\">يمكنك إزالة المعلومات الشخصية من ملفك الشخصي في أي وقت باستخدام واجهة الموقع.</p>\r\n\r\n<h2 dir=\"RTL\">10. توضيح حقوقك</h2>\r\n\r\n<p dir=\"RTL\">1.10. لديك الحق في الوصول إلى معلوماتك الشخصية وتعديلها ، والتي نقوم بمعالجتها وفقًا لهذه السياسة.</p>\r\n\r\n<p dir=\"RTL\">إذا كنت تعتقد أن أي معلومات تخزنها الشركة عنك غير صحيحة أو غير كاملة ، يمكنك تسجيل الدخول إلى حسابك وتصحيح معلوماتك الشخصية بنفسك.</p>\r\n\r\n<p dir=\"RTL\">إذا تم توفير ذلك بموجب القانون المعمول به ، فيحق لك:</p>\r\n\r\n<p dir=\"RTL\">- طلب حذف معلوماتك الشخصية .</p>\r\n\r\n<p dir=\"RTL\">- طلب للحد من معالجة المعلومات الشخصية الخاصة بك .</p>\r\n\r\n<p dir=\"RTL\">- الإعتراض على معالجة معلوماتك الشخصية ، إذا كان ذلك مطلوبًا بموجب القانون المعمول به.</p>\r\n\r\n<p dir=\"RTL\">ستلتزم الشركة بالطلبات المحددة وفقًا للقانون الساري المعمول به .</p>\r\n\r\n<p dir=\"RTL\">في الحالات التي ينص عليها القانون المعمول به ، قد يكون لديك أيضًا حقوق أخرى.</p>\r\n\r\n<p dir=\"RTL\">2.10. كيف يمكن ممارسة هذه الحقوق؟</p>\r\n\r\n<p dir=\"RTL\">لممارسة الحقوق المذكورة أعلاه ، قم بتسجيل الدخول إلى الحساب على الموقع ، وفي حالة عدم وجود وظيفة خاصة &nbsp;للقيام بذلك في الواجهة للموقع ، اتصل بنا (انظر القسم 13).</p>\r\n\r\n<p dir=\"RTL\">إذا كان لديك تعليقات على معالجة بياناتك ، فيحق لك إرسال شكوى إلى الشركة من خلال نموذج الموقع. إذا لم تكن راضياً عن رد الشركة ، يحق لك رفع شكوى لدى السلطات المختصة بذلك .</p>\r\n\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">11. ملفات تعريف الارتباط ( الكوكيز ) والتقنيات المشابهة على الموقع</h2>\r\n\r\n<p dir=\"RTL\">1.11. ما هي ملفات تعريف الارتباط ( الكوكيز ) ولماذا نستخدمها</p>\r\n\r\n<p dir=\"RTL\">ملفات تعريف الارتباط هي ملفات نصية صغيرة موضوعة على الجهاز الذي تستخدمه للوصول إلى الموقع. وهي تحتوي على معلومات مخزنة على جهازك وترسل مرة أخرى إلى الموقع مع كل زيارة لاحقة من أجل تذكر أفعالك واهتماماتك حتى بعد مرور الوقت على زيارتك للموقع.</p>\r\n\r\n<p dir=\"RTL\">نستخدم الأنواع التالية من ملفات تعريف الارتباط:</p>\r\n\r\n<p dir=\"RTL\">- ملفات تعريف الارتباط / ملفات تعريف الارتباط الضرورية للغاية: تعد ملفات تعريف الارتباط هذه ضرورية لتشغيل الموقع .</p>\r\n\r\n<p dir=\"RTL\">- ملفات تعريف الارتباط الإحصائية / التحليلية: تسمح لك ملفات تعريف الارتباط هذه بالتعرف على المستخدمين ، وحساب عددهم وجمع المعلومات ، مثل العمليات التي تقوم بها على الموقع ، بما في ذلك المعلومات حول صفحات الويب التي قمت بزيارتها والمحتوى الذي تتلقاه .</p>\r\n\r\n<p dir=\"RTL\">- ملفات تعريف الارتباط الفنية: تقوم ملفات تعريف الارتباط هذه بجمع معلومات حول كيفية تفاعل المستخدمين مع الموقع ، مما يسمح باكتشاف الأخطاء واختبار الميزات الجديدة لتحسين أداء الموقع .</p>\r\n\r\n<p dir=\"RTL\">- ملفات تعريف الارتباط الوظيفية: تسمح لك ملفات تعريف الارتباط هذه بتوفير وظائف معينة لتسهيل استخدامك للموقع ، على سبيل المثال ، حفظ تفضيلاتك (مثل موقع العناصر الوظيفية والإعدادات الأخرى للموقع) .</p>\r\n\r\n<p dir=\"RTL\">- ملفات التتبع (ملفات تعريف الارتباط الإعلانية) (الطرف الثالث): تقوم ملفات تعريف الارتباط هذه بجمع معلومات حول المستخدمين ومصادر الزيارات والصفحات التي تتم زيارتها والإعلانات المعروضة لك ، بالإضافة إلى تلك التي قمت بزيارتها في الصفحة التي تم الإعلان عنها. تسمح لك بعرض الإعلانات التي قد تهمك ، بناءً على تحليل الصفحات التي قمت بزيارتها.</p>\r\n\r\n<p dir=\"RTL\">2.11. إلى متى يحتفظ جهازك بملفات تعريف الارتباط؟</p>\r\n\r\n<p dir=\"RTL\">نحن نستخدم هذه الملفات فقط للأغراض المحددة أعلاه. بعد ذلك ، يتم تخزين البيانات التي تم جمعها على جهازك لمدة معينة ، والتي قد تعتمد على نوع ملفات تعريف الارتباط المناسب ، ولكن لا تتجاوز الوقت اللازم لأداء وظيفتها. ثم يتم إزالتها تلقائيًا من النظام الخاص بك.</p>\r\n\r\n<p dir=\"RTL\">3.11. من إلى جانبنا يمكنه الوصول إلى المعلومات الموجودة في ملفات تعريف الارتباط؟</p>\r\n\r\n<p dir=\"RTL\">يمكن استخدام المعلومات من ملفات تعريف الارتباط من قبل الشركة أو شركاء الشركة (انظر القسم 7). على مواقع الطرف الثالث ، قد يخضع استخدام هذه المعلومات لأغراض ترويجية لاتفاقات منفصلة. يمكننا نحن أو شركاؤنا أن نوفر لك الفرصة لإلغاء الاشتراك في الإعلانات المخصصة.</p>\r\n\r\n<p dir=\"RTL\">عندما تزور الموقع لأول مرة ، نطلب موافقتك على استخدام ملفات تعريف الارتباط. إذا كنت تريد تغيير رأيك لاحقًا ، فيمكنك ببساطة حذف ملفات تعريف الارتباط في متصفحك. بعد ذلك ، سنطلب موافقتك مجددًا على استخدام ملفات تعريف الارتباط ويمكنك إجراء اختيار آخر. إذا رفضت استخدام ملفات تعريف الارتباط ، فقد يؤدي ذلك إلى حقيقة أن بعض وظائف الموقع لن تكون متاحة لك.</p>\r\n\r\n<p dir=\"RTL\">يمكنك أيضًا تغيير إعدادات المتصفح لقبول أو رفض جميع ملفات تعريف الارتباط أو ملفات تعريف الارتباط من مواقع معينة ، بما في ذلك موقعنا ، افتراضيًا. يعتبر الموافقة على استخدام ملفات تعريف الارتباط بمثابة إذن منك لاستخدامها.</p>\r\n\r\n<p dir=\"RTL\">يمكن للشركة أيضًا استخدام إشارات الويب (علامات البكسل) للدخول إلى ملفات تعريف الارتباط الموضوعة مسبقًا على جهازك للأغراض التالية:</p>\r\n\r\n<p dir=\"RTL\">1) تحديد إجراءاتك على الموقع وفي عملية استخدام الخدمات عن طريق الوصول إلى ملفات تعريف الارتباط المخزنة على جهازك واستخدامها .</p>\r\n\r\n<p dir=\"RTL\">2) جمع المعلومات الإحصائية المتعلقة بتشغيل الموقع والمنتجات والمرافق والاقتراحات الخاصة بالشركة.</p>\r\n\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">12. التحديثات والإضافات</h2>\r\n\r\n<p dir=\"RTL\">يمكن تعديل سياسة الخصوصية وتحديثها وفقًا لتقدير الشركة أو في حالة حدوث تغيير في القوانين المعمول بها. نتعهد بعدم إجراء تغييرات مهمة على السياسة دون إشعار إضافي ، على سبيل المثال ، في شكل إعلان بانر أو نافذة منبثقة. كما يمكن إرسال إشعارات تغيير في سياسة الخصوصية عبر قنوات اتصال أخرى (على سبيل المثال ، عبر البريد الإلكتروني).</p>\r\n\r\n<h2 dir=\"RTL\">13. التغذية الراجعة</h2>\r\n\r\n<p dir=\"RTL\">سنكون سعداء للإجابة على أي أسئلة حول هذه السياسة. للاتصال بنا ، يمكنك استخدام النموذج الموجود على هذه الصفحة  <a href=\"http://Tajrobtak.com/information/support\" title=\"Support\">http://Tajrobtak.com/information/support</a>. إذا كانت لديك أية شكاوى أو رسائل مهمة أخرى تتعلق بالسياسة أو بمعالجة معلوماتك الشخصية ، فالرجاء الاتصال بنا أيضًا.</p>\r\n');
