(2, 'IPhone 7', 'IPhone 7', 'iphone_7', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean euismod bibendum laoreet. Proin gravida dolor sit amet lacus accumsan et viverra justo commodo. Proin sodales pulvinar tempor. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Nam fermentum, nulla luctus pharetra vulputate, felis tellus mollis orci, sed rhoncus sapien nunc eget.san et viverra justo commodo. Proin sodales pulvinar tempor. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Nam fermentum, nulla luctus pharetra vulputate, felis tellus mollis orci, sed rhoncus sapien nunc eget.', 'https://gstore.ua/images/42/apple-iphone-7-plus-128gb-silver-56542353760195_small6.png', 3, 4, 3, '2018-11-23 03:23:18', 4, 0),
(3, 'Samsung N7100 Galaxy Note I', 'سامسونج N7100 ملاحظة غالاكسي I', 'samsung_n7100_galaxy_note_i', '<div class=\"content-container\"><h3>Наполните жизнь яркими красками с дисплеем Super AMOLED</h3>\r\n\r\n<p>Готовы увидеть действительно яркие цвета? Дисплей Infinity Display с экраном HD+ Super AMOLED диагональю 5,6 дюйма и с соотношением сторон 18.5:9 максимально увеличивает полезную площадь экрана. Таким образом, на экране Galaxy J6 вы сможете созерцать яркие красочные изображения от края до края.</p>\r\n&nbsp;\r\n\r\n<div align=\"center\"><img height=\"460\" src=\"//i.citrus.ua/upload/medialibrary/d4d/251454.jpg\" width=\"817\"></div>\r\n&nbsp;\r\n\r\n<h3>Удобный и стильный</h3>\r\n\r\n<p>Удобство и стиль для активной жизни. Благодаря обтекаемой форме корпуса с плавными изящными линиями смартфон Galaxy J6 идеально ложится в ладонь. Выберите для себя один из четырех цветов, который наилучшим образом будет соответствовать вашему стилю.</p>\r\n&nbsp;\r\n\r\n<div align=\"center\"><img height=\"460\" src=\"//i.citrus.ua/upload/medialibrary/fbc/ua_ru-feature-fluidity-and-style-100876873.jpg\" width=\"621\"></div>\r\n&nbsp;\r\n\r\n<h3>Работайте в режиме многозадачности</h3>\r\n\r\n<p>Яркий 5.6-дюймовый дисплей Infinity Display идеально подходит для работы в режиме многозадачности, включая игры, написание текстовых сообщений и веб-браузинг. А благодаря функции App Pair вы сможете запускать сразу два приложения и, например, смотреть видео во время переписки с друзьями.<sup>1</sup></p>\r\n&nbsp;\r\n\r\n<div align=\"center\"><img height=\"486\" src=\"//i.citrus.ua/upload/medialibrary/d50/100876869.jpg\" width=\"900\"></div>\r\n&nbsp;\r\n\r\n<h3>Три уровня яркости</h3>\r\n\r\n<p>Добавьте яркости объекту съемки. Яркость фронтальной вспышки Galaxy J6 регулируется по трем уровням для съемки четких и ярких селфи даже ночью.</p>\r\n&nbsp;\r\n\r\n<div align=\"center\"><img height=\"531\" src=\"//i.citrus.ua/upload/medialibrary/aec/100876887.jpg\" width=\"900\"></div>\r\n&nbsp;\r\n\r\n<h3>Проявите креативность</h3>\r\n\r\n<p>Добавьте своим фотографиям немного креатива. Камера Galaxy J6 имеет множество режимов настройки и позволяет добавлять к сделанным вами снимкам креативные фильтры.</p>\r\n&nbsp;\r\n\r\n<div align=\"center\"><img height=\"460\" src=\"//i.citrus.ua/upload/medialibrary/5f5/100876865.jpg\" width=\"760\"></div>\r\n&nbsp;\r\n\r\n<h3>Делитесь своими фотографиями с друзьями</h3>\r\n\r\n<p>Редактируйте свои фото и видео с помощью различных креативных эффектов и создавайте свои собственные индивидуальные истории. Вы сможете с легкостью распределять свои фото и видео по категориям и делиться ими с друзьями и родными благодаря расширенному функционалу.</p>\r\n&nbsp;\r\n\r\n<div align=\"center\"><img height=\"460\" src=\"//i.citrus.ua/upload/medialibrary/f39/100876883.jpg\" width=\"486\"></div>\r\n&nbsp;\r\n\r\n<h3>Двойной Мессенджер</h3>\r\n\r\n<p>Разделите свои чаты для рабочего и личного использования. Функция \"Двойной Мессенджер\" позволяет установить два отдельных аккаунта для одного и того же мессенджера.<sup>2</sup> Установить и управлять вторым аккаунтом в мессенджере можно с главного экрана.</p>\r\n&nbsp;\r\n\r\n<div align=\"center\"><img height=\"450\" src=\"//i.citrus.ua/upload/medialibrary/79d/1008768751.jpg\" width=\"601\"></div>\r\n&nbsp;\r\n\r\n<h3>Защищенная папка</h3>\r\n\r\n<p>Защищенная папка — это мощное решение для защиты ваших данных, которое позволяет создать зашифрованное пространство в памяти смартфона для хранения персонального контента в виде фотоснимков, документов и звуковых файлов, доступ к которым будете иметь только вы.<sup>3</sup></p>\r\n&nbsp;\r\n\r\n<div class=\"table\">\r\n<div class=\"table-row\">\r\n<div class=\"table-cell\">\r\n<h3>Большое пространство для хранения данных</h3>\r\n\r\n<p>Больше места для хранения. Вместе с Galaxy J6 пользователю предлагается до 15 ГБ пространства в облачном хранилище Samsung Cloud, где он сможет хранить нужные данные и к которым он сможет получить доступ в любом месте и в любое время.<sup>4</sup></p>\r\n</div>\r\n\r\n<div class=\"table-cell\"><img height=\"280\" src=\"//i.citrus.ua/upload/medialibrary/c05/1008768771_1.jpg\" width=\"455\"></div>\r\n</div>\r\n</div>\r\n&nbsp;\r\n\r\n<h3>Сканер отпечатка пальца</h3>\r\n\r\n<p>Упростите разблокировку телефона с защитой, которой вы можете доверять. Galaxy J6 оснащен надежным сканером отпечатка пальца, который позволяет легко и удобно заходить в учетные записи на веб-сайтах и в приложениях.</p>\r\n&nbsp;\r\n\r\n<div class=\"table\">\r\n<div class=\"table-row\">\r\n<div class=\"table-cell\"><img height=\"390\" src=\"//i.citrus.ua/upload/medialibrary/399/100876885.jpg\" width=\"284\"></div>\r\n\r\n<div class=\"table-cell\">\r\n<h3>Следите за своим здоровьем</h3>\r\n\r\n<p>Поддерживайте оптимальный баланс в своем образе жизни. Galaxy J6 оснащен функцией Samsung Health, которая контролирует вашу физическую активность, привычки в питании и режим сна в одном удобном и безопасном месте для быстрого и легкого доступа.<sup>5</sup></p>\r\n</div>\r\n</div>\r\n</div>\r\n&nbsp;\r\n\r\n<h3>Удобное управление Wi-Fi</h3>\r\n\r\n<p>Экономьте мобильный трафик и заряд батареи благодаря адаптивному управлению Wi-Fi на Galaxy J6. Смартфон запоминает, в каких местах вы подключались к Wi-Fi, и мгновенно подключает к известной сети, когда вы находитесь в зоне ее действия. Когда вы покидаете зону покрытия, Wi-Fi отключается, чтобы не разряжать батарею.<sup>6</sup></p>\r\n&nbsp;\r\n\r\n<div align=\"center\"><img height=\"445\" src=\"//i.citrus.ua/upload/medialibrary/54e/5363.jpg\" width=\"900\"></div>\r\n&nbsp;\r\n\r\n<h3>Распознавание лиц</h3>\r\n\r\n<p>Теперь вы можете разблокировать свой телефон мгновенно, просто поднеся его к лицу. Технология распознавания лиц открывает доступ к телефону только вам, чтобы ваши личные данные не попали в чужие руки.</p>\r\n&nbsp;\r\n\r\n<p></p>\r\n&nbsp;\r\n\r\n<p><sup><span style=\"color: #959595; font-size: 8pt;\">1</span></sup><span style=\"color: #959595; font-size: 8pt;\">Функция App Pair доступна только в поддерживаемых приложениях.</span></p>\r\n\r\n<p><sup><span style=\"color: #959595; font-size: 8pt;\">2</span></sup><span style=\"color: #959595; font-size: 8pt;\">Приложения для мгновенного обмена сообщениями, поддерживаемые функцией \"Двойной Мессенджер\" могут отличаться в зависимости от страны и региона.</span></p>\r\n\r\n<p><sup><span style=\"color: #959595; font-size: 8pt;\">3</span></sup><span style=\"color: #959595; font-size: 8pt;\">Доступность этого сервиса может отличаться в зависимости от формата шифруемого контента. Защищенная папка разделяет память на уровне программного обеспечения.</span></p>\r\n\r\n<p><sup><span style=\"color: #959595; font-size: 8pt;\">4</span></sup><span style=\"color: #959595; font-size: 8pt;\">Доступность сервисов и пространства для хранения может отличаться в зависимости от страны, оператора или вашей среды. 15 Гб памяти бесплатно предоставляется для каждой учетной записи Samsung.</span></p>\r\n\r\n<p><sup><span style=\"color: #959595; font-size: 8pt;\">5</span></sup><span style=\"color: #959595; font-size: 8pt;\">Браслет Gear Fit продается отдельно.</span></p>\r\n\r\n<p><sup><span style=\"color: #959595; font-size: 8pt;\">6</span></sup><span style=\"color: #959595; font-size: 8pt;\">Cкорость подключения Wi-Fi может изменяться в зависимости от среды использования.</span></p></div>', 'http://craftmann.org/cat/7287.167.samsung_N7100_Galaxy_Note_II_black.jpg', 1, 3, 3, '2018-11-23 03:23:18', 4, 0),
