INSERT INTO `yy_reviews_content` (`id`, `review_id`, `content`, `lang`, `sort`) VALUES
(1, 1, 'EN EN Samsung N7100 Galaxy Note II Три года вместе. Актуальна ли лопата сегодня? Стоит ли присмотреться к ней в случае выбора б/у смартфона? Фото: её и на неё ツ Сравнение с Iphone 5S, и многое другое', 'en', 1),
(2, 1, 'ARABIC TEXT BLAH BLAH', 'ar', 1),
(3, 1, 'Хочу рассказать о телефоне Samsung N7100 Galaxy Note II, с которым мы вместе около 3 лет, правда примерно полгода-год он отдыхал, пока я развлекалась с более новыми и симпатишными моделями)\r\n<b>Эта тема, я думаю, по-прежнему актуальна - ведь б/у или даже новые модели еще можно найти в продаже.</b>\r\n<br>\r\nТри года назад мой горячо любимый Galaxy Note I, на который я нарадоваться не могла целый год, был потоплен в водах Финского залива во время путешествия на байдарках, и так и не найден.\r\n<br>\r\nЧерез пару месяцев взамен был куплен Galaxy Note II, и то, что он уступает предыдущей модели - было понятно уже с первых минут знакомства...', 'en', 2),
(4, 1, 'Хочу рассказать о телефоне Samsung N7100 Galaxy Note II, с которым мы вместе около 3 лет, правда примерно полгода-год он отдыхал, пока я развлекалась с более новыми и симпатишными моделями)\r\n<b>Эта тема, я думаю, по-прежнему актуальна - ведь б/у или даже новые модели еще можно найти в продаже.</b>\r\n<br>\r\nТри года назад мой горячо любимый Galaxy Note I, на который я нарадоваться не могла целый год, был потоплен в водах Финского залива во время путешествия на байдарках, и так и не найден.\r\n<br>\r\nЧерез пару месяцев взамен был куплен Galaxy Note II, и то, что он уступает предыдущей модели - было понятно уже с первых минут знакомства...', 'ar', 2),
(5, 1, '<b>1. Корпус<b>\r\n<br>\r\nНоут 1 был сделан из какого-то классного материала, который не царапался и уж, тем более, не трескался. Не смотря на то, что время от времени падал и на асфальт, и слетал с крепежа в машине и летал через весь салон. Ноут 2 сделан из тоненького дешевого пластика, который без чехла в очень скором времени зацарапался и при первом же падении пошел трещинками:', 'en', 3),
(6, 1, '<b>1. Корпус<b>\r\n<br>\r\nНоут 1 был сделан из какого-то классного материала, который не царапался и уж, тем более, не трескался. Не смотря на то, что время от времени падал и на асфальт, и слетал с крепежа в машине и летал через весь салон. Ноут 2 сделан из тоненького дешевого пластика, который без чехла в очень скором времени зацарапался и при первом же падении пошел трещинками:', 'ar', 3),
