(51, 65, 'В этот раз по моей просьбе в компании изменили свою модель \"под меня\", добавив вырез в нижней части для подпихивания пальцем и вдвое укоротив крышу - для более комфортного открытия под верхней одеждой...\n\nК чему, собственно, такое длинное предисловие? А к тому, что как-то незаметно сложился некий гротескный образ несчастного изможденного гика, который якобы исключительно в силу следования за гаджет-модой вынужден покупать настолько нелепые устройства, как Galaxy Note (Note II) и потом мучиться с ним каждую секунду - от непомерного веса устройства, гнущего к земле, от размеров, из-за которых он всегда выпадывает из рук, от необходимости постоянно носить это чудо в руках по причине невлезаемости в любые карманы... то ли дело 3,5 дюйма! Идеальный размер для всех! Да?\n\nКонечно же, нет. Люди покупают Note II (Note) для того, чтоб иметь современное устройство с большим комфортным экраном, и уж поверьте - покупают они его совершенно осознанно. Зная заранее, как они будут с ним обращаться и где они его будут носить.', 'en', 4),
