(56, 75, 'Течения в проливе: зимой — поверхностное, несущее менее солёную воду, направлено в Красное море, и глубинное, с более солёной водой — из Красного моря. Летом сток солёных вод из Красного моря осуществляется поверхностным течением (глубина до 25—50 м) и придонным течением (от 100—150 м до дна), приток вод в Красное море — промежуточным течением (глубина от 25—50 м до 100—150 м).', 'en', 0),
