(98, 102, 'Interesting places of St. Petersburg Inspection of the cultural heritage of Peter-the lot of tourists. For almost a year, done in St. Petersburg, I have never seen the wiring of bridges. Beheld them only in a diluted condition. Not a sight caused me emotion, because often only from the bridges I encountered, when I urgently had to get to the other half. So it\'s either the Cable-stayed bridge and overdadige funds the taxi or wait for the crotch of the reunification of the hour at 3 in the morning, actually that doesn\'t happen every time and not on any bridge. Schedule wiring I knew in those days than any other than the multiplication table. Not every native Petersburger was in the Hermitage or the Mariinsky. It is believed that the fact that you live alone in St. Petersburg, means aware of all the museums, theaters, visited any Opera and performances. I remember that the moment when my people found out about my existence in the Northern city of Moscow, I fell down a hail of questions-where to go, where to book', 'en', 3),
