(101, 103, 'Such we were lucky to achieve only a mechanical cleaning, but the cleaning is quite complicated and very time consuming (vets in the city, this consonant is not present, in consequence of this I purchased a set of tools a special dog and has done the massacre of a dog together with her husband)\n\nNow seeing the end of the 1st use, I can confidently say in fact that I won\'t need it, I\'ll spread the gel on the teeth and neatly Polish brush, for example, already seen by the aroma from a mouth that actually has the ability to not laugh when your dog every day gets to kiss =)\n\nThe gel does not contain certain of the incarnate scent, the dog sniffs and won\'t complain more than usually (and in comparison with mechanical cleaning including less kicking), no allergies, will complete a review approximately through a week when the teeth are cleaned entirely I suppose =)', 'en', 2),
(103, 105, 'Bought this telephone 4 years ago and it is still working like i have just bought it ! i swear GUYS it is the most powerfull usefull thing i have ever bought in my entire life , i will never regret buying this telephone . when i first bought it it coasted me 770 JD and there was a problem with the battery , so i send it to apple with a message and they tottaly helped me by replacing it with a new one. \n', 'en', 0),
