(105, 105, 'works perfect but it has it is own minuses , when it is cold out side it turns off when it is like -10 it dose not hold for 10 minutes even if it was 100% charged the battery .', 'en', 3),
(106, 105, 'another problem was the storage memory i had 64 Gb and for now i had to move all the pictures to my laptop so i can take more pictures.\n', 'en', 5),
(107, 105, 'another thing with the apple\'s phones is that you can not share everything with everyone , sometimes i got really mad when it was about a homework , like sending me from a samsung a pictures about the homework or what books to take from the laibrary .', 'en', 6),
(108, 105, 'how ever i will not buy the next generation of this phone because in my own opinion apple did not come up with something more creativ than other companies and the prices of course every year just gets HIGHER .\n\nbut i will recommend all buying this telephone , buy it and you won\'t regret after 3 years of using it i bought my wife on her birthday and she was very happy with it although the iphone 7 was allready in the markets.\n', 'en', 8),
(109, 106, 'OKAY so let\'s start with this amazing looking TEAPOT that might burns your arms while making TEA with your family, so here is the story , i was in the mall with my wife trying to select a teapot for our small family and our small money wallet , so we bought this teapot , everything was perfect until the cap went off , it made of plastic a CHEAP plastic and with no idea that it should take on a very high tempreature .', 'en', 0),
