(113, 107, 'A pathetic excuse for an American comic book movie.\nBefore watching the \"Defenders\", I heard a lot of feedback about this film from colleagues who watched it together before me.\n\n\"Defenders\", to put it mildly, were not praised. Well, I thought. They do not understand anything in fiction, I still look.', 'en', 0),
(114, 107, 'Looked. As if mildly to write? Very bad. It\'s like watching a knockoff of the American comic strip \"a La Rus\". And, if for the USA comics are \"our everything\", for us comics are not the, not native and not close. \n\nThere was a feeling that the authors of the \"Defenders\" have seen enough \"x-Men\", \"Avengers\", \"suicide Squad\" and all the same, concocted their vinaigrette of American ingredients and flavored it all with a sauce from the pseudo history of the former USSR. Obviously, to the viewer it was clear that this is still a domestic movie, and not some kind of Western. ', 'en', 2),
(115, 107, 'The main positive characters (four of them) are invented on the principle - the more wonderful, the better. One bear with a machine gun growing from withers that only costs! Logan of the American \"x-Men\" with its retractable hand knives, nervously smokes on the sidelines, feeling your own weakness and insignificance compared to the mighty Russian bear.\n\nAbout the other characters I will not write, look it up yourself. If you like.\nI do not know who will be interested in \"Defenders\". Maybe the boys are 10-12 years old? While there, in the picture there are scenes of violence, and the film has an age restriction of 12+.\n\nIn General, we looked, wept from the wasted time. \nAdvise to watch the Defenders will not, and to heed the advice or not is up to you.', 'en', 4),
(116, 108, '\"Why is he doing this?\"A book with a key question, the answer to which opens your eyes, and sometimes just saves a life. It is highly recommended for reading to anyone who is inclined to find excuses for unpleasant behavior in relation to any man - father, brother, husband, friend, friend.\n\nThe author is very colorful, and most importantly simple and clear, describes all the types of male manipulators, male tyrants, male despots, male abusers. Explains why and why they\'re doing this or that. Why do they first seem nice and wonderful, but then suddenly everything changes. Why it is impossible to please them. Shows how they create in others the impression of a remarkable man, hiding his dark side. And he says directly and without embellishment: such behavior is not and can not be justified.', 'en', 0),
(117, 108, 'How can this book help?\n\nFirst, the book will help dispel once and for all the opinion \"something is wrong with me, and so he behaves unpleasantly / rude / hit me / yelled / etc.\". Only those who have given themselves the right to violence against another person are guilty of violence.\n\nSecondly, the book will help to further recognize toxic relationships at an earlier stage, and thus leave with less loss for mental and physical health.\n\nThird, for women already in a difficult situation, suffering humiliation from a significant man, the book can be a signal to action, becoming a beacon: this attitude is not normal.', 'en', 1),
(118, 108, 'Take a couple of hours of this book. Sometimes we suffer this, what later recall with great horror. And let this book will help to make such memories as little as possible.', 'en', 2),
(119, 109, 'The restaurant is popular. Food without restrictions (as buffet). During the day you can eat for $ 12 per person, in the evening $ 24 (added to the range of crabs (tentacles), oysters, all kinds of seafood). Children under 3 years free of charge. \nAlways fresh and delicious. There are also desserts (fruit, cookies, cake and ice cream ). The staff is very attentive. Often guests come to celebrate birthdays, the staff brings a cake or a small dessert with a candle, turn on and sing a song, and all visitors clap together. On weekdays at lunch and on weekends (especially at night) waiting tables 15-20 minutes as a lot of people.', 'en', 0),
(122, 111, 'Great cafe for lovers of Japanese cuisine. Always in the evening you can find Kamchatka (Alaska) crab, sushi, sashimi and rolls. For a fixed small cost per person a decent buffet. Crab is only for evening (for dinner). Sashimi are not bad, but the range could be increased.', 'en', 0),
(123, 112, 'Solid body, reliable suspension, front-wheel drive, original appearance, normal driving performance', 'en', 0),
(124, 112, 'Stock engine from \"Wartburg\"three-cylinder two-stroke 45 horsepower.\nOriginal spare parts for the three-cylinder engine are expensive, they are difficult to find on sale.Private ownership of the car B1000 is still a bill of lading. It is very difficult and expensive to buy spare parts and body iron. ', 'en', 1),
(125, 113, 'Quite a powerful vacuum cleaner with its size and at first glance seeming fragility. The car is an indispensable thing, not only qualitatively clean the interior of the dust, but as it turned out able to collect liquid and quite efficiently does it. This fact I was pleasantly surprised by the cigarette lighter. Included are nozzles, but unfortunately it would not hurt to equip the device with a cover for more convenient storage.', 'en', 0),
(126, 114, 'My dear subscribers. I introduce you to another tool for hair straightening from the new brand Paul Oscar-Detox Collagen SPA Complex Moist Care.\nI\'ve never made such high-profile statements before, but it\'s just awesome composition. Struck me with the result, brilliance, lack of smell. Another notable novelty of the outgoing year.', 'en', 0),
(127, 114, 'The peculiarity of the new tool is that, in addition to straightening and disciplining, it performs the function of purification (actually, detox).\nThe set includes three products-shgo, intensive mask-Reconstructor and the final procedure serum-fluid \"5 in one\", which is not washed off. Detox effect is, by the way, shampoo. It cleanses and prepares the hair to take the mask and its components.\nStill like that at the end of the fluid is applied, and not a standard mask, it has a nice consistency, it is easy to apply and it can be used separately as thermal protection. Do not wash off the hair after application.', 'en', 2),
(128, 115, 'Means for washing acne acne Acniwash Cleanser-just super good was, especially with my skin problems. My skin is very oily, very strong, I would say. I have to dust myself five times a day. Cream matting does not save much. Therefore, the foam that I tried to have the principle well maybe even she will help me, and cheers!\nFrom the first application felt the effect of it, I only three hours a day decided to powder, and it is more of a habit. Highly recommend. I get up in the morning - I do not form a greasy film overnight. For a month of use I have rashes become much less. But then I still added funds from this series, when I realized that the foam suits me, so I evaluate everything in the complex. Definitely still going to buy.', 'en', 0),
(129, 116, 'Bought a baby bath company Tega Folk, when my daughter was born. I really liked it. Since it is very easy to use. Very light and it can be easily put on a chair. Very resistant. Thus, you can not be afraid that it will turn over. Very pleasant to the touch, smooth without any rough edges that could not be better for baby\'s delicate skin. There is a special recess for the sponge and soap. That simplifies bathing of the child. And since the first time I bathed in potassium permanganate, and after draining the water remains sediment, it is easily washed off with a sponge and soap. So choosing this bath for my daughter, I never regretted and was very pretty. What do you suggest. And in addition, the plastic is very dense and does not crack and does not bend from different temperatures. And the most important plus there is no extraneous smells.', 'en', 0),
(130, 117, 'The lid fits snugly and nothing splashes when mixed. The measuring Cup is inserted into the cap.\nSpoon for stirring. Not very convenient. The upper part, which must be kept small. But, in principle, got used already.\nThe bowl is high and roomy. It is installed on the base easily. No loose ends.\nThe cord is not particularly long, but I have enough. The socket next to the table.\n\nEasy to wash. There is no unpleasant smell of plastic. Not too noisy. Nothing is sprayed and not poured out during use. \nI use it for the third month. With its tasks blender copes perfectly. And pates, and soups-puree, and smoothies-all is obtained.\nIf you are looking for a blender with these features, I recommend.', 'en', 0),
(131, 118, 'Paddywagon Tours company becomes one of the famous brands of Ireland such as Guinness and U2.\nIt offers one-day, multi-day and private tours of Ireland. You can visit many interesting places, see the amazing nature and ancient castles. There is even a tour to Northern Ireland which is part of the UK.', 'en', 1),
(132, 118, 'Do I recommend such day tours? Yes, of course, especially if you are briefly staying in the capital and want to see different parts of Ireland without the cost of moving and booking hotels.\nThe main thing is to be lucky with the weather.\nThat\'s all she wrote.\nI wish you interesting journeys!\nThank you for attention!', 'en', 6),
(133, 119, 'I bought it for my cat, though she is at home and aged, but loves different toys, happy to play with the ball, chasing mice. I thought she\'d be interested in this tunnel as a distraction.', 'en', 0),
(134, 119, 'Here\'s a bright and colorful tunnel with two pendants, colors are different, the tunnel can be folded, if the animal does not play them at the moment, the sides of the tunnel has ribs that allow it to be fixed.', 'en', 2),
(135, 119, 'My cat liked it very much, so I did not lose with the purchase. She likes the ball on the suspension ring, she hits it with his paw, that sound to hear. So funny, loves to play in the tunnel, but sometimes just likes to lay there.\nGreat stuff for cats and cats! My beauty appreciated it!\nI recommend to those who have a cat, kitty or small kittens, they probably will be particularly interesting.\nThank you all for your attention to my review!', 'en', 3),
(136, 120, 'Another cartoon from DC, which is probably a little better than those I watched earlier. As far as I understand it is a sequel to the \"Death of Superman\", which I did not watch and therefore did not understand everything in this cartoon. Cartoons from DC I do not like, this was no exception. DC shoots cartoons, which can be called comics, reworked in the video. On the one hand, the characters are drawn well enough, but on the other there is not enough dynamics and pumping graphics, emotions of the characters are not expressive and almost do not cause any feelings, the movements look inorganic. \nThe plot in principle is banal and uninteresting: villains are driven by motives of revenge. In the cartoon, a lot of scenes that in principle do not carry a semantic load, with little action. There are no unexpected moments. The moral themes for which I appreciate modern full-length cartoons are not revealed. Not over than to start thinking after viewing this cartoon, immediately forgotten, all that was seen. These ca', 'en', 0),
(137, 121, 'The book contains a lot of quotes, aphorisms and interesting statements. For example, a satirical poem about the homeopathy of William Croswell Doan, perfectly characterizing this method of treatment:\nShake the solution, and let\nIt will stand a little, \nAnd after drip a little\nDeep water.\nFrom the pond every other day\nDrink a teaspoon, \nAnd the sickness will leave you forever —\nIt was not her!\n\nThere are also several chapters on the history of traditional medicine, its development and formation. In General, the book is very complete and deep. Be sure to download yourself another electronic option is not always convenient to search audioprojektai the right Chapter.\n\nThere is also a fly in the ointment (as, indeed, in all good books): I think the authors \' attitude to alternative medicine is somewhat biased. After all, if we want to find flaws in something, we find them without noticing the advantages-this is how our brain works. And any search engine works the same way. For example, assume a case when write in', 'en', 0),
(138, 122, 'Today my short story about another cafe - coffee shop Maehongson. I must say that the coffee I drink here did not happen. I thought that a Cup of latte 75 baht against 40 baht in a nearby coffee shop-it\'s expensive. Moreover, the quality of coffee will be exactly the same-excellent. It is a cafe rather with a bias in restaurant with a wide choice of good wine. I came just at the moment when the young man from the staff broke, you can see a good bottle of wine. There\'s no cheap wine here. Went incredible wine smell all over the shop. Well, since there is absolutely no prohibition to admire, view and photograph the institution, then I boldly went to do it. I first came in, Mehongson in 2012 and in my eyes, every time I return, the local communities grew and expanded. That this institution three years ago was not. There was just a store, a very unusual store and about it below, which sold original products of Northern Thailand. But three years ago, the financial Affairs of this store have developed successfully ', 'en', 0),
(139, 122, 'Any wine. I do not know the price, but I\'m sure it\'s not cheap. But I must say that visitors here as a holiday. I think that this unpopular with the mass of tourists of the town, such institutions are unlikely to particularly cost-effective and profitable. Everything from simple coffee, here is twice as expensive as in no worse coffee shops around the corner. But how beautiful', 'en', 4),
(140, 122, 'There\'s that door to my favorite store. At first it was one store. Pass past him never impossible. First of all, because it\'s all from the walls, including the ceiling, plastered with sheets of glossy magazines. Study the original Wallpaper is no less interesting than the contents of the store. By the way, on one page of the magazine I found a young Sophia Loren. And the journals themselves - Wallpapers give the impression of a distant past.', 'en', 6),
(141, 122, 'On the door hang the toy on a string. Is the art of making these dolls came from an old Burma.\nA couple of visitors drinking coffee on the street. That\'s good', 'en', 8),
(142, 123, 'Baumkuchenspitzen Aldi-Sud with rum and dark chocolate is by far my favorite wood pies. Yes, the Germans-they are such strange people that they make pies that mimic a tree trunk. No, not the cake \"Log\". And no cake \"the Stump\". Everything is much more complicated. They mimic straight cut WITH ANNUAL RINGS. Don\'t ask me why. But they started doing it at least in the fifteenth century, and still continue (at least in the mid-fifteenth someone had the sense to write down the recipe). Remnants of the middle ages, in short, but very tasty! Technology since then has changed somewhat, and the ingredients, too, but the meaning remained.', 'en', 1),
(143, 123, 'Baumkuchen wood pies are baked very cleverly. Round stick dipped in dough-and baked on the weight, with it in the course of business twist like a skewer. Then again dipped-and baked. And so-ten-twenty times. The result is a typical cylindrical pie, with a hole from a wooden skewer in the middle - and in the section it really looks like a cut of wood. Because the ruddy crust of each layer of dough form something optically similar to the annual ring. Wood pies are usually impregnated with some confectionery flavor (in the old days it was pink water, now in the course of things are stronger) and covered with chocolate. Flavors are different, chocolates are different too, but I\'m an absolute fan of Baumkuchenspitzen Aldi-Sud with rum and bitter chocolate, so sorry, I just can\'t tell you what they are yet. Once I tried everything that I got, but stopped at this particular grade of this particular seller. A gift that Aldi is a discounter. Maybe someone has a Baumkuchenspitzen better than them, but I just have not c', 'en', 3),
(144, 123, 'A couple of packages for the winter to buy is quite possible, I think. Anyway, I\'ll buy it again next year. I love them! And to do it yourself is very time-consuming.', 'en', 5);
