(145, 124, 'The mask I bought two pieces. One with ginger - for hair growth, the other-with olive-for moisture. About Oliva will have a different opinion.\nAt first I wanted to give this mask, because two masks of 500 ml seemed to me a great luxury. But God took that idea away and I opened it.\nThe fact that not a single word in Russian. \nBut there is an abstract glued to the packaging of the jar. If you want to keep the abstract, just do not throw away this oilcloth, which closed the Bank.', 'en', 0),
(146, 124, 'On each Bank, in the first place, there is a hologram - it immediately inspires confidence. And secondly, the double protection thanks to the spool. No one will be able to try your product.\nIt is necessary to say about volume - 500 ml. This is not huhry - muhry, especially on my short hair. Enough for more than half a year, unless my faithful will help. That\'s a plus. \nThe smell is divine. Rich, when applied to the hair-opens, then long remains on the hair. My husband likes the smell - plus.\nThe price, of course, bites.', 'en', 2),
(147, 124, 'For use: used until a couple of times. Used as air conditioning-under the heat cap, half an hour went. Under the end of the half an hour head bakes. Great-so ginger works. \nIt is worth saying that the mask and the color is nice.\nAfter applying a special softness of hair, I did not notice. My hair is hungry for moisture and this mask can\'t handle it. But, to say the word, it should not do this, because its main purpose - hair growth. \nAfter prolonged use, I will add a review and tell you how it copes in helping growth. \nSo far, only recommend because of the volume and smell divine.', 'en', 4),
(152, 127, 'its so nice for spending ur time when u are boring\nthe funny thing that ps4 allows to his users to play together at same time', 'en', 0),
(153, 128, 'Film talking about an artist that does a crime with his love and they both dont admite their crime\nand the victim parents tries to find out who is the real criminal..the film is bit long but its very stirring and it has so suprising end', 'en', 0),
(158, 131, 'I bought 10 instead of iPhone 8. I used all models of iPhones. There is nothing to compare. So I do not know why everyone likes the OLED matrix? Because of the deep black color? It\'s all bullshit. And the problems of ice screens are many times greater than those of IPS. Whatever you say, my eyes got more tired after half an hour of working with a smartphone (who do not know OLED displays have what is called PWM, in simple language they flicker a lot (you can look at OLED display through the camera and see). Therefore, I always tried to buy smarts from IPS screen. Besides, OLED Dispeys are very whimsical, have a shorter service life, because of all these minuses I never liked Samsung because of their poisonous color.\nIn general, I decided for myself, if this year the epl will release a new smart with an IPS display, then I will change the iPhone 10 to it, since for me the display has become critically worse!\n\nRegarding Faith IDE, of course, a controversial decision, I personally liked more to unlock the phone ', 'en', 1),
(159, 132, 'its really nice strategy game and one of the most competiteve games i have ever played i really recommend this game\nmaybe it has no good graphic but its really popular and funny game', 'en', 0),
(160, 133, 'one of the most popular shooting / survival games\nthis game has a really realastic graphics\nbut the negative point that this game isnt free to play\nalso its not multi plat for game ', 'en', 0),
(161, 134, 'one of the most popular shooting game\nin the game u will play as a person who lands an island and try to survive in it\nits multiplayer game and there are 100 player in the island trying to survive \nwhen u just land on it u had to search for weapons and tools to set up your self and as the time goes the island get smaller and gets more surrounded by the zone and if somebody stay in the zone he he will slowly die\nalso there is another game mode in the same game its called \"save the world\" u had to save the world from zombie invade with ur freinds in this mode and upgrading ur weapons\nthe game is free to play and with nice graphics also its multiplatfrom game', 'en', 1),
(162, 135, 'mortal Kombat is fighting video game\nthere are a lot of warriors in the game u had to select one of them and to fight with it\neverysingle warrior has unique abilities\nbut they all have mutual abilities which are : (punch/kick/high kick/high punch)\nu had to use your these in specific sequense to get an ability like this :\" left arrow + high punch = throw a fire ball\"\nit has a really good realistic\nalso in the end of fights there is so nice finishing its called ( fatality ) with nice animation', 'en', 0);
